(9352, 13, 'PROBADOR DE BILLETES PORTATIL', 'ZC273400', 'Brand New', 'Portátil de mano antorcha lámpara UV detector de billetes\r\nVerificar las características de seguridad sobre los billetes y pasaportes\r\nComprobar marcas de agua y las tiras de seguridad\r\nAlteraciones Resaltar y tinción\r\nTambién puede detecta moneda extranjera, pasaporte, banco draft, cheque, factura de impuestos de valor añadido\r\nCómo utilizar:\r\nDeslice el interruptor lateral hacia "tubo" para encender la lámpara UV\r\nDeslice el interruptor lateral hacia "torch" para encender la lámpara blanca\r\nPara apagar el interruptor deslizante interruptor lateral a la posición central\r\nCambie las pilas cuando las luces comienzan a apagarse\r\nFuncionamiento con baja battries mA dañar la lámpara\r\nNo deslice el interruptor lateral a la posición "tubo" con la lámpara UV elimina\r\nEsto puede dañar el circuito de accionamiento de la UV\r\nQuite las pilas cuando la lámpara no se va a utilizar durante algún tiempo\r\n \r\nEspecificaciones:\r\nLuz negra de mano requiere 4 * pilas AA (no incluidas)\r\nDimensión: 16*5.4*2.3 cm\r\n \r\nEl paquete incluye:\r\n1 x detector de billetes falsos (sin pilas)', '', NULL, 'TEC1471', 23, 1, 54, 125, 1, 16, '2016-04-13', '2016-07-28', 1, 15000, 16, 1, NULL, 1, 296, '2016-07-28 08:15:18'),
