(9610, 9, 'POLLY POCKET! FIESTA DE DISFRACES POLLY', 'REF CJT34', 'MATTEL', 'Polly y sus amigas están listas para tener la mayor diversión en esta fiesta de disfraces! Desde atletas, hasta artistas pasando por bailarinas a estrellas de rock. ¡Hay un disfraz detrás del sueño de cada niña! Incluye cuatro muñecas y 10 modas.Producto sujeto a cambios por inventario. Puede llegar en cualquier presentación.Valido por una unidad.\r\n', '', NULL, 'JUG0765', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-05-02', 1, 18000, 26, 1, NULL, 2, 13, '2016-05-02 15:31:58'),
