(9612, 9, 'EVER AFTER HIGH PICNIC ENCANTADO SURTIDO DE MUÑECAS', 'CLL49', 'MATTEL', 'Raven Queen™, Cerise Hood™ y Blondie Lockes™, están planeando un encantador picnic! Todas se ven encantadoras con hermosos vestidos y encantadores detalles. Incluyen cepillo y soporte. Producto sujeto a cambios por inventario. Puede llegar en cualquier presentación', NULL, NULL, 'JUG0766', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 18000, 26, 1, NULL, 2, 13, '2016-04-29 22:41:22'),
