(9614, 9, 'HW PAQUETE DE 5 MAX STEEL', 'BBR24', 'MATTEL', 'Cinco increíbles autos diseñados para recrear ¡Todas las aventuras de Max Steel favoritas de los niños! Producto sujeto a cambios por inventario. Puede llegar en cualquier presentación.', NULL, NULL, 'JUG0767', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 18000, 26, 1, NULL, 2, 13, '2016-04-29 22:47:06'),
(9615, 9, 'HW TORMENTA EXTREMA', 'CDL45', 'MATTEL', 'Los autos Hot Wheels avanzan y avanzan. ¡Lo que no se sabe es cuándo chocarán! Los niños podrán lanzar sus autos, que darán increíbles giros y podrán chocar en tres zonas de choque. Con dos lanzadores, los niños podrán retar a sus amigos para añadir más autos a la pista, hasta que se encuentren en un increíble choque. ¿Quieres correr en otras pistas? Sólo gira la trampa del final para embarcarte en una nueva aventura. Producto sujeto a cambios por inventario. Puede llegar en cualquier presentación.', NULL, NULL, 'JUG0768', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 18000, 26, 1, NULL, 2, 13, '2016-04-29 22:54:25'),
(9616, 7, 'LOCIÓN LACOSTE', 'LOCIÓN LACOSTE BLUE', 'LACOSTE', 'Lacoste Blue 3.3 Onz', NULL, NULL, 'PER1456', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 20000, 26, 1, NULL, 2, 13, '2016-04-29 23:08:22'),
(9617, 9, 'FARSHOT', 'BJH60', 'MATTEL', '¡Farshot™ funciona por un sistema de resorte que dispara hasta una distancia de 22 metros! Es un lanzador que permite a los niños experimentar una nueva manera de jugar con la tecnología Smart Stick™. ¡ambién tiene escudos removibles para atrapar los dardos de tus oponentes y espacio en el mango para dos dardos Smart Stick™ Incluye un objetivo Smart Stick y tres dardos Smart Stick. Producto sujeto a cambios por inventario. Puede llegar en cualquier presentación.', NULL, NULL, 'JUG0769', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 18000, 26, 1, NULL, 2, 13, '2016-04-29 23:10:56'),
(9618, 7, 'KIT DE PELUQUERIA', '5 STAR', 'WAHL', 'Cuenta con un motor V 9000 silencioso y con funcionamiento en frio, a su vez la  palanca se ajusta el apurado, el grosor y la textura, sus hojas se ajustan para producir una superposición cero.\nIncluye:\n-3 peines de guías (1.5mm – 4.5mm)\n-peine de estilo\n-aceite\n-cepillo de limpieza\n-manual de instrucciones\n-protector de cuchilla roja.', NULL, NULL, 'PER1457', 0, 0, 0, 0, 1, 16, NULL, NULL, 1, 22000, 26, 1, NULL, 2, 13, '2016-04-29 23:15:06'),
(9619, 9, 'SLAM BLAST', 'CFD42', 'MATTEL', 'Con Slambast™ dispara tan rápido como puedas y alcanza hasta 18 metros. ¡Mientras más rápido dispares, más lejos llegarán los dardos! Almacena hasta ocho dardos en el mango y a los lados, además tiene un riel para colocar accesorios BoomCo. Incluye un objetivo Smart Stick™ y ocho dardos Smart SticK. Producto sujeto a cambios por inventario. Puede llegar en cualquier presentación.', NULL, NULL, 'JUG0770', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 18000, 26, 1, NULL, 2, 13, '2016-04-29 23:15:25'),
(9620, 9, 'UNO CARTAS', 'W2085', 'MATTEL', 'El juego de cartas familiar #1 en el mundo! Tendrás que deshacerte de todas tus cartas lo más rápido posible utilizando tus habilidades de estrategia y colocando “trampas” a tus oponentes con las cartas de comando. No te olvides de gritar UNO cuando sólo te quede una carta. Incluye baraja de cartas UNO.', NULL, NULL, 'JUG0771', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 12000, 26, 1, NULL, 2, 13, '2016-04-29 23:21:13'),
(9621, 9, 'HW AV2 QUINJET LANZADOR DE MOTOS', 'CCW95', 'MATTEL', 'Basado en la película, los fans podrán recrear sus escenas favoritas mientras juegan, utilizando este icónico Quinjet Lanzador de Motos. Coloca cualquier Moto de Avengers dos dentro del lanzador, levántalo y manda la moto a volar por los aires. Cuando sea el momento de competir en increíbles carreras; sólo jala la palanca y lanza la Moto de Iron Man por la pista. ¡Pelea contra Ultron con el Quinjet Lanzador de Motos! Incluye una Motocicleta de Avengers 2. Producto sujeto a cambios por inventario. Puede llegar en cualquier presentación.', NULL, NULL, 'JUG0772', 0, 0, 0, 0, 1, 16, '2016-04-29', '2016-04-29', 1, 18000, 26, 1, NULL, 2, 13, '2016-04-29 23:25:53'),
(9622, 7, 'WHISKY BUCHANAN S', 'Buchanan’s 12 años', 'BUCHANAN S', 'Buchanan’s 12 años', NULL, NULL, 'PER1458', 0, 0, 0, 0, 1, NULL, '2016-04-29', '2016-04-29', 0, 20000, 26, 1, NULL, 2, 13, '2016-04-29 23:33:02'),
