(9624, 7, 'WHISKY JW BLACK LABEL', 'JW BLACK LABEL', 'JW BLACK LABEL', 'Johnnie Walker Black Label es un verdadero ícono, reconocido como referente para todas las otras mezclas de lujo. Creado usando solo whiskies de mínimo 12 años de añejamiento de los 4 rincones de Escocia, Johnnie Walker Black Label tiene un inconfundible carácter profundo, suave y complejo. Un whisky excepcional para compartir en cualquier ocasión, sea pasando un rato agradable en casa con sus amigos o en una salida inolvidable.', NULL, NULL, 'PER1459', 0, 0, 0, 0, 1, 0, NULL, NULL, 0, 20000, 26, 1, NULL, 2, 13, '2016-04-29 23:42:57'),
