(9630, 23, 'SHOW ILUSIONISMO', 'SHOW ILUSIONISMO', 'FIRE STREET', 'Espectáculo donde un mago profesional realiza diferentes números escénicos basado en distintas técnicas, como la magia clásica que utiliza elementos como sombrillas, pañuelos, aparición y desaparición de patos, palomas, conejos etc.  También números de ilusión como suspensión gregoriana, mujer partida en dos, la descabezada y otros', NULL, NULL, 'EXP0011', 0, 0, 0, 0, 1, 16, '2016-05-04', '2016-05-04', 1, 0, 30, 1, NULL, 1, 296, '2016-05-04 10:13:21'),
(9631, 23, 'SHOW MAGIA', 'SHOW MAGIA', 'FIRE STREET', 'Espectáculo donde un mago profesional realiza diferentes números escénicos basado en distintas técnicas, como la magia clásica que utiliza elementos como sombrillas, pañuelos, aparición y desaparición de patos, palomas, conejos etc.  También números de ilusión como suspensión gregoriana, mujer partida en dos, la descabezada y otros.', NULL, NULL, 'EXP0012', 0, 0, 0, 0, 1, 16, '2016-05-04', '2016-05-04', 1, 0, 30, 1, NULL, 1, 296, '2016-05-04 10:16:19'),
(9632, 4, 'CUENTRERO-NARRADOR', 'CUENTERO', 'FIRE STREET', 'narradores de historias que valiendose de su comicidad utilizan la hiperbole, la parodia, la dramaturgia y en algunos casos del stand up comedy para interactuar con el público asistente mediante  relatos entretenidos y jocosos, remembrando o trayendo a colación experiencias cotidianas en común o simplemente historias de fantasía o realidad que dejan una reflexión profunda sobre los valores y sentimientos que rigen nuestra vida. SHOW POR 50MIN', NULL, NULL, 'LIN0008', 0, 0, 0, 0, 1, 16, '2016-05-04', '2016-05-04', 1, 0, 30, 1, NULL, 1, 296, '2016-05-04 10:24:24'),
(9633, 23, 'COMEDIANTE', 'SHOW COMEDIANTE', 'FIRE STREET', 'Puesta escénica que intenta descubrir si el nombre artístico de este grupo traduce (estar en talento) o (carecer de él). Muy seguramente por medio de la dramaturgia, la música y la paradoja  implícitas en este stand up comedy, descubriremos a que se refieren. Ellos harán carcajear al público asistente mediante su búsqueda desesperada de originalidad musical y un sin número de anécdotas divertidas que surgen en el marco de la cotidianidad entre dos músicos de diferentes regiones del país, quienes por obvias razones tienen formas muy distintas de expresión e interpretación del lenguaje. SHOW X50MIN', NULL, NULL, 'EXP0013', 0, 0, 0, 0, 1, 16, '2016-05-04', '2016-05-04', 1, 0, 30, 1, NULL, 1, 296, '2016-05-04 10:59:38'),
