(9784, 9, 'MUÑECA BARBIE', 'BARBIE ESCUADRÓN SECRETO AGENTE SECRETO', 'BARBIE', 'Barbie Escuadrón Secreto es la nueva película de acción de Barbie donde protagoniza a una gimnasta de clase mundial. Ella es reclutada para ser agente secreto junto con sus amigas Teresa y Renee. Barbie luce increíble con su traje púrpura y cinturón de accesorios, un abrigo y lentes rosa. Cuando es momento de escapar, coloca el accesorio de espía en su espalda y ella empezará a hacer impresionantes ruedas.', NULL, 1, 'JUG0775', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 30, 1, 'N2', 2, NULL, NULL),
(9785, 9, 'JUGUETE NIÑA', 'POLLY POCKET! ¡DIVERSIÓN BAJO LA LLUVIA!', 'POLLY POCKET', 'Acompaña y y juega bajo la lluvia Polly! En este increíble set de diversión de Polly Pocket, podrás ver el agua caer, correr y saltar sobre los charcos, vive una aventura inolvidable. Edad: 4+ Años.Incluye: Un Set de juego, 1 Muñeca.', NULL, 1, 'JUG0776', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 30, 1, 'N3', 2, NULL, NULL),
