(9790, 9, 'ARTÍCULO PARA BEBÉ', 'F-P SILLA MECEDORA AMIGOS DE LA NATURALEZA', 'FISHER PRICE', 'Moderna silla mecedora con vibraciones relajantes, un cómodo asiento y juguetes elevados. Cuenta con  Barra de juguetes desprendible con dos juguetes para alcanzar Las vibraciones relajantes ayudan a calmar al bebé El cojín del asiento se lava a máquina y viene con un adorable patrón de los Amigos de la Naturaleza Diseño moderno, no se resbala Funciona con 1 pila D', NULL, 1, 'JUG0781', 0, 0, 0, 11.3, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 30, 1, 'N8', 2, NULL, NULL),
(9791, 9, 'ARTÍCULO PARA BEBÉ', 'RF SURTIDO GIMNASIO PIANO PATADITAS MUSICALES', 'FISHER PRICE', 'El bebé patea. La música se oye. Y eso es sólo el principio. Los juguetes móviles de la parte superior del gimnasio invitan al bebé a golpearlos y agarrarlos. Mueve el arco hacia abajo para juegar boca abajo o sienta a tu bebé y ¡mira cómo se entretiene dándote un concierto de piano! VIene con un piano removible para que lleves la música a donde tu bebé y tú vayan  Cuatro formas de jugar: Recostarse y jugar; Sobre su pancita; Sentarse y jugar; Llevar a cualquier parte  La música recompensa a tu bebé conforme patea las teclas del piano  5 entretenidos juguetes y un espejo grande  Los juguetes incluyen una mordedera de hipopótamo, cuentas de elefante, rana que rueda y más  Música por periodos cortos o largos—hasta 15 minutos continuos Suave y cómodo tapete Control de encendido/volumen Requiere 3 baterías AA ', NULL, 1, 'JUG0782', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 30, 1, 'N9', 2, NULL, NULL),
(9792, 9, 'AUTOS DE JUGUETE', 'HOTWHEELS PAQUETE DE 5', 'HOT WHEELS', 'Los paquetes de cinco autos Hot Wheels contienen los más increíbles vehículos a escala 1:64. Cada paquete es una colección instantánea', NULL, 1, 'JUG0783', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 25, 1, 'N10', 2, NULL, NULL),
(9793, 9, 'FIGURA DE ACCIÓN', 'MAX STEEL SURTIDO FIGURAS BÁSICAS', 'MAX STEEL', 'Los niños estarán listos para liberar a su héroe interior con estas figuras que están listas para derrotar a sus adversarios.  Simplemente aprieta el botón para activar sus armas.  Incluye una figura con accesorio. Recomendado para mayores de 4 años Garantia de 3 meses Producto no a eleccion, esto quiere decir que cliente recibirá cualquiera de las 3 figuras.', NULL, 1, 'JUG0784', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 25, 1, 'N11', 2, NULL, NULL),
(9794, 9, 'FIGURA DE ACCIÓN', 'Spiderman Figura Marvel Titan Hero Ultimate 12"', 'MARVEL TITAN HERO', 'Figura de acción articulada. Esta figura de acción de Marvel de 12 pulgadas fomenta el juego imaginativo. Una tela de araña radiactiva cambió la vida de Peter Parker para siempre, dándole poderes súper humanos y capacidad para arrastrarse por las paredes!  Recomendado para niños mayores de 4 años.', NULL, 1, 'JUG0785', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N12', 2, NULL, NULL),
(9795, 9, 'JUEGO PARA BEBÉS', 'Mesa de juego animales', 'FISHER PRICE', 'La Mesa de Juegos Animales Fisher Price, gracias a su forma, permite a los bebés afirmarse sobre la mesa y desarrollar su musculatura y fuerza en la piernas, aunque también puede utilizarse sentado o junto a una silla de niños.  Sobre la Mesa de Juegos Animales Fisher Price podrás encontrar varios juegos y actividades que mantendrán entretenido a tu hijo por mucho tiempo, introduciéndolo en un maravillo mundo de colores, sonidos y nuevas sensaciones. Sus botones de colores, les enseñará los primeros números y las formas más básicas, mientras que las peltas que giran, los llevará al mundo de la música. Y en el centro, su rueda les mostrará las primeras letras del abecedario, complemento ideal para el libro que tiene incorporado. Edad recomendada: +6 meses', NULL, 1, 'JUG0786', 13, 41, 55, 1.7, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N13', 2, NULL, NULL),
(9796, 9, 'MOCHILA PARA BEBÉS', 'Arné Mochila León', 'FISHER PRICE', 'Arné mochila diseño león 2 En 1. Arné para control niño Y mochila para una muda. Ideal para viajes y paseos. Diseño entretenido, amigable, suave y no invasivo.', NULL, 1, 'JUG0787', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N14', 2, NULL, NULL),
(9797, 9, 'AUTO DE JUGUETE', 'Hot Wheels Bahía de la serpiente', 'HOT WHEELS', 'Los niños disfrutarán al máximo de este paseo por la imponente selva de la isla salvaje, pero ¡cuidado con la serpiente que disfruta la comida sobre ruedas! Este set portátil se despliega y cuenta con 12 frases que te brindarán una electrizante diversión. Incluye un auto Hot Wheels. 12 frases y sonidos. No requiere montaje.', NULL, 1, 'JUG0788', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N15', 2, NULL, NULL),
(9798, 9, 'AUTO DE JUGUETE', 'Rc Con Interchang Body', 'HOT WHEELS', 'Tipo: radio controlado Marca: Hot Wheels Modelo: HW63256 Color: multicolor Edad recomendada: 3 + Género: niño Incluye pilas: sí Tipo de pilas: AA N° de pilas: 3 Incluye cargador: sí Accesorios: control remoto', NULL, 1, 'JUG0789', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N16', 2, NULL, NULL),
(9799, 9, 'LEGO NIÑOS', 'Lego Star wars', 'LEGO', 'La Micro Nave Star Destroyer Lego Star Wars tiene una gran cantidad de detalles tomados del gigante caza estelar del imperio, por lo que cuenta potentes motores en su parte trasera, además de 2 misiles y una mini cabina donde el piloto imperial se ubicará y dominará toda la batalla. Solo necesitarás poner en marcha los motores, sentir el lado oscuro de la fuerza y lanzarte a la conquista de los rebeldes.  El set de bloques armables de Lego contempla 97 piezas con las que tus hijos podrán armar esta espectacular micro nave. Y luego, con ella, podrán volar por toda la galaxia hasta localizar a los rebeldes y atacarlos con sus misiles. La persecución puede ser intensa, deberán enfrentarse cara a cara, pero el piloto imperial tiene una carta bajo la manga, su pistola láser. Este es un juego recomendado para menores de entre 6 y 12 años.', NULL, 1, 'JUG0790', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N17', 2, NULL, NULL),
(9800, 9, 'LEGO NIÑAS', 'Palacio Real de Las Mascotas 41142', 'LEGO', 'Incluye a Dreamy (la gata de la princesa Aurora) y Windflower (el mapache de Pocahontas). El Palacio real de las mascotas cuenta con 2 plantas, tejado dorado, 2 torres, comedor, sala de música, pista de baile giratoria y mirador. Prepara el castillo para un gran baile y hornea el delicioso pastel. Organiza un espectáculo en la sala de música y una fiesta en la pista de baile giratoria. Coloca a cada mascota de palacio en su lugar especial para descansar bien durante la noche. El Palacio real de las mascotas mide más de 16 cm de altura, 13 cm de ancho y 13 cm de profundidad. Las torres del Palacio real de las mascotas se pueden intercambiar con las secciones especiales de los sets Día en la piscina de Treasure (41069), Salón de belleza de Daisy (41140) y Carroza real de Pumpkin (41141) para disfrutar de una experiencia de juego a medida con las mascotas de palacio.', NULL, 1, 'JUG0791', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N18', 2, NULL, NULL),
(9801, 9, 'LEGO CARAVANA', 'Camioneta y Caravana', 'LEGO', 'Incluye 2 minifiguras: un excursionista y una excursionista; incluye también un perro. Cuenta con una furgoneta con puertas abatibles y caravana desmontable que se abre para dar acceso a una pequeña cocina y una cama. Carga la caravana, engánchala a la furgoneta y conduce hasta el camping. Accesorios incluidos: una barbacoa, 2 salchichas, un hueso, 2 tazas y una máquina de café. La furgoneta mide más de 6 cm de altura, 12 cm de longitud y 6 cm de ancho. La caravana mide más de 6cm de altura, 13 cm de longitud y 5 cm de ancho.', NULL, 1, 'JUG0792', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N19', 2, NULL, NULL),
(9802, 9, 'SILLA PARA BEBÉ', 'Bebesit - Silla Nido', 'BEBESIT', 'Silla Nido 8515 Mimo Columpio-mecedora 7 divertidas melodías que entretienen al bebé y 3 sonidos de naturaleza. 5 velocidades de balanceo y 3 de configuraciones de temporizador. Barra de juguetes pivotante desmontable. Plegado fácil para transportar y guardar. Su ajuste reclinable de doble posición, es confortable para el crecimiento del bebé. Peluches afelpados Arnés de seguridad con alojamientos del hombro. Uso recomendado: 3-11 kilos (9 meses aproximadamente) No recomendado para niños que puedan sentarse sin ayuda. No esta diseñada para cargar bebés. Usar siempre sobre el suelo ( no superficies elevadas o blandas)', NULL, 1, 'JUG0793', 0, 0, 0, 0, 1, 19, '2016-05-05', '2016-05-05', 1, 4700, 5, 1, 'N20', 2, NULL, NULL),
