(9930, 13, 'RADIO PARA CARRO MVH-075UB', 'MVH-075UB', 'PIONEER', 'El MVH-075UB es un reproductor multimedia ideal para los usuarios de dispositivos móviles Android* pues permite, a través de una conexión vía el puerto USB frontal, el acceso a la música contenida en el smartphone con opciones como búsqueda automática, reproducción de enlace o modo de pasajero.\nEs compatible con los formatos de audio CD, MP3, WMA y WAV. Para sumar a esta ventaja de la compatibilidad de archivos, este modelo brinda la útil función de restaurador de sonido avanzado para mejorar la calidad de reproducción de los archivos almacenados en dispositivos portátiles, que generalmente sufrieron un proceso de compresión previo.', NULL, NULL, 'TEC1546', 0, 0, 0, 0, 1, 16, NULL, NULL, 1, 28000, 16, 1, NULL, 2, 14, '2016-05-12 17:48:27'),
(9931, 13, 'RADIO PARA CARRO DEH-X2850UI', 'DEH-X2850UI', 'PIONEER', 'El DEH-X2850UI tiene por característica una pantalla VA LCD de 13 dígitos que provee alto contraste y amplio ángulo de visión. Esto mantiene una vista clara de la pantalla desde el asiento del conductor.  Esta diseñado para reproducir por USB la música de  dispositivos portátiles tales como tu iPod®, iPhone®, Android™ 4.1 y posteriores vía MTP y AOA 2.0 (Android Open Accesory) y permite la reproducción de archivos MP3/WAV/WMA.', NULL, NULL, 'TEC1547', 0, 0, 0, 0, 1, 16, NULL, NULL, 1, 28000, 16, 1, NULL, 2, 14, '2016-05-12 17:52:38'),
(9932, 13, 'RADIO PARA CARRO DVH-785AV', 'DVH-785AV', 'PIONEER', 'DVH-785AV permite que combines el mejor sonido con el mejor video pues reproduce DVD, CD, MP3, WMA y fotografías. Cuenta con pantalla de 3 pulgadas, radio FM, control de subwoofer, entrada USB y auxiliar y otra para cámara de reversa. Calidad sorprendente al alcance de tu mano', NULL, NULL, 'TEC1548', 0, 0, 0, 0, 1, 16, NULL, NULL, 1, 28000, 16, 1, NULL, 2, 14, '2016-05-12 17:58:02'),
