(9941, 7, 'PERFUME ONE MILLION', 'ONE-MILLION', 'PACO RABANNE', 'Perfume para hombre One Million de Paco Rabanne 100 ml. Es una fragancia de la familia olfativa amaderada especiada para hombres. 1 Million se lanzó en 2008, 1 Million fue creada por Christophe Raynaud, Olivier Pescheux y Michel Girard. Las Notas de salida son toronja (pomelo), menta y mandarina roja; las notas de corazón son rosa, canela y notas especiadas; las Notas de Fondo son cuero , notas amaderadas, ámbar y pachulí hindú.', NULL, NULL, 'PER1495', 0, 0, 0, 0, 1, 16, NULL, NULL, 1, 21000, 26, 1, NULL, 2, 14, '2016-05-13 13:01:19'),
