(10072, 5, 'ECOPISO S/REGATON', 'PK912209', 'GENERICO ', 'Ecopiso sin regatón y se utiliza como sobrepiso para proteger del agua en bodegas, furgones, caminos en plantas industriales, rejillas de canales, piso con granjas porcinas, avìcolas y cuartos fríos. Capacidad de carga 2 toneladas x pulgada cuadrada. 60 cms largo x 40 cms ancho x 4 cms alto. Colores Gris y verde.', '', 1, 'HOG1731', 0, 0, 0, 0, 1, 0, '2016-05-19', '2016-05-19', 1, 16000, 26, 1, 'W7', 2, NULL, NULL),
(10073, 5, 'MANGUERA EXPANDIBLE', 'MANGUERA EXPANDIBLE', 'GENERICO', 'Al momento de que el agua entra por el tubo de la manguera esta comienza a expandirse hasta 3 veces su tamaño original y al momento de drenarla regresa a su tamaño original. Es muy ligera y fácil de transportar. No se dobla al momento de usarla por lo que nunca dejara de salir agua. Es sumamente resistente.  Contiene los empaques necesarios para que no goteé al conectarla a la llave de agua. Es novedoso ninguna manguera en el mercado se expande 3 veces lo de su tamaño original. está compuesta por 2 mangueras, una manguera interior expandible y una manguera exterior plegable. La manguera interior está compuesta de latex lo que le da una resistencia y dureza para no cuartearse ni que presente grietas por el uso.  La manguera exterior está elaborada por nylon de alta calidad con hilos expandibles lo que hace que pueda expandir 3 veces su tamaño.  Al momento de que el agua entra por el tubo de la manguera esta comienza a expandirse hasta 3 veces su tamaño original y al momento de drenarla regresa a su tamaño original. Es muy ligera y fácil de transportar. No se dobla al momento de usarla por lo que nunca dejara de salir agua. Es sumamente resistente.  Contiene los empaques necesarios para que no goteé al conectarla a la llave de agua. Es novedoso ninguna manguera en el mercado se expande 3 veces lo de su tamaño original. EXPANDE HASTA 30 MTS ', '', 1, 'HOG1732', 0, 0, 0, 0, 1, 0, '2016-05-19', '2016-07-01', 1, 25000, 26, 1, 'W8', 2, 303, '2016-07-01 12:10:28'),
(10074, 13, 'CÁMARA WEB', 'FACECAM 321', 'GENIUS', 'Genius presenta una nueva cámara web VGA Plug&Play, la FaceCam 321, que le permitirá disfrutar de imágenes claras y brillantes para sus llamadas de video. Con una definición de 8MP y un zoom digital 3X, podrá lograr videos de alta calidad y asombrosos acercamientos. El enganche universal puede usarse con su computadora, equipo portátil, ultrabook o como soporte independiente. Es una cámara web simple y fácil de usar, que le permitirá mantenerse en contacto con sus seres amados o compartir momentos importantes con sus amigos.', '', 1, 'TEC1571', 0, 0, 0, 0, 1, 0, '2016-05-19', '2016-05-19', 1, 16000, 16, 1, 'W9', 2, NULL, NULL),
(10075, 13, 'USB POWERED WOOD SPEAKERS', 'SP-HF150', 'GENIUS', 'Alimentación por USB. – Conector de audio: Jack 3.5. – Compatible tanto con PC como con MAC – Control de volumen. - See more at: http://blog.zbitt.com/altavoces-de-madera-genius-sp-hf150-wood-speakers/?cbg_tz=300#sthash.NWf7SWt4.dpuf', '', 1, 'TEC1572', 0, 0, 0, 0, 1, 0, '2016-05-19', '2016-05-19', 1, 18000, 16, 1, 'W10', 2, NULL, NULL),
