(10170, 48, 'SENSIBILIDAD DE PRECIOS Y PROMOCIONES', 'INCS19-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Comparativo de precios y promociones en el sector.\r\nOBJETIVO: Generar un comparativo de precios y promociones, entre competidores directos en el Sector.\r\nMETODOLOGÍA: Investigación cuantitativa.\r\nTÉCNICA: Visitas de recolección de información.\r\nMUESTRA: Se hace la estructura del protocolo de visita para evaluar un máximo de 3 líneas de producto, visitando máximo 5 puntos de venta.\r\nREQUERIMIENTOS:Acceso al Autoservicio. Elección de los 3 productos a evaluar.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Entrega informe con conclusiones y recomendaciones.\r\nPRE-REQUISITO: Sondeo de publicidad.', '', NULL, 'ALC0001', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:50:12'),
(10171, 48, 'POSICIONAMIENTO EN EL SECTOR', 'INCS23-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Identifica el nivel de recordación y posicionamiento del Autoservicio.\r\nOBJETIVO: Por medio de este estudio se puede determinar el nivel de fidelización, aceptación y recordación que tiene el Autoservicio en el sector.\r\nMETODOLOGÍA: Investigación cuantitativa.\r\nTÉCNICA: Recolección de Información en campo.\r\nMUESTRA: Se hace la estructura la encuesta. Se encuestan 100 clientes y 100 transeúntes del sector.\r\nREQUERIMIENTOS: Dirección Autoservicio.\r\nCOBERTURA: Nivel nacional.\r\nENTREGABLE: Entrega informe con conclusiones y recomendaciones.\r\nPRE-REQUISITO: Tráfico de clientes.', '', NULL, 'ALC0002', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:51:08'),
(10172, 15, 'COMEDOR PARA AVES', 'Heimtiebedarf 1 LT-Verde', 'GENERICA', 'Comedero para aves.\r\ncapacidad:1Lt.\r\nDiseño Moderno.\r\nMaterial de Alta Resistencia', NULL, NULL, 'MAS0049', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 24000, 26, 1, NULL, 2, 13, '2016-05-24 11:58:53'),
(10173, 48, 'TRÁFICO DE CLIENTES', 'INCS24-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Determina momentos de compra con el fin de fijar estrategias promocionales.\r\nOBJETIVO: Esta investigación determina y compara el tráfico de clientes de cada uno de los competidores con el fin de determinar estrategias para aumentar las ventas en horas estacionales.\r\nMETODOLOGÍA: Investigación cuantitativa.\r\nTÉCNICA: Recolección de Información en campo\r\nMUESTRA: Se hace la planeación de la actividad. Se monitorean 6 puntos de venta por un periodo de 4 horas en el mismo día, incluye el mismo punto de venta.\r\nREQUERIMIENTOS: Dirección Autoservicio. Selección del horario de evaluación.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE:  Entrega informe con conclusiones y recomendaciones.\r\nPRE-REQUISITO: Sociodemográfico (Perfiles y misiones)', '', NULL, 'ALC0003', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:52:44'),
(10174, 49, 'ELEMENTOS QUE MOTIVAN A SUS EMPLEADOS', 'INCS25-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Analizar las necesidades y expectativas de los colaboradores.\r\nOBJETIVO: Determina el nivel de necesidades y expectativas de los empleados con el fin de mejorar la productividad a partir de los motivadores de los mismos.\r\nMETODOLOGÍA: Investigación cualitativa.\r\nTÉCNICA: Sesión de grupo.\r\nMUESTRA: Se hace la planeación de la actividad. Se ejecuta la actividad en un espacio diferente al del punto de venta. Se entrega un pequeño  refrigerio a los asistentes.\r\nREQUERIMIENTOS: Espacio mínimo de 3 horas con un mínimo de 4 y máximo de 6 colaboradores en un espacio que no este influenciado por sus superiores o jefes.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Entrega informe con conclusiones y recomendaciones.\r\nPRE-REQUISITOS: Satisfacción de cliente o satisfacción de clientes frecuentes.', NULL, NULL, 'CTE0001', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 12:38:42'),
(10175, 49, 'CLIMA ORGANIZACIONAL', 'INCS26-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Evalúa el nivel de conformidad y aceptación de los colaboradores.\r\nOBJETIVO: Determina las relaciones interpersonales, desde el punto de vista organizacional, líderes y colaboradores.\r\nMETODOLOGÍA: Investigación cualitativa.\r\nTÉCNICA: Trabajador oculto.\r\nMUESTRA: Ingresa un auditor como parte del equipo de trabajo del Autoservicio durante una semana, interactuando en todos los espacios con los diferentes empleados y extrayendo información relevante sobre cada persona y su pertenencia con el Autoservicio.\r\nREQUERIMIENTOS: Ingreso de la persona durante 5 días entre semana, para trabajar en diferentes áreas del Autoservicio.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Entrega informe con conclusiones y recomendaciones.\r\nPRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', '', NULL, 'CTE0002', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:54:47'),
(10176, 50, 'EXHIBICIÓN EN PUNTO DE VENTA', 'INCS32-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Identificar la exhibición en el punto de venta, el manejo actual de la misma y su impacto.\r\nOBJETIVO: Genera un diagnóstico del uso de las exhibiciones sobre la cara de góndola, tope o punta de góndola, base de góndola y entrepaños con el fin de garantizar tanto en el vertical como en el horizontal las caras del producto así como la visibilidad. \r\nMETODOLOGÍA: Investigación cualitativa.\r\nTÉCNICA: Recolección de información y observación.\r\nMUESTRA: Se hace el protocolo de observación para una sección del Autoservicio, toma de registros fotográficos.\r\nREQUERIMIENTOS: Datos de ubicación del Autoservicio, acceso al mismo y autorización para la toma de registros fotográficos.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Entrega informe con conclusiones y recomendaciones, incluye fotos.\r\nPRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', '', NULL, 'ETE0001', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:55:48'),
(10177, 50, 'USO DEL MATERIAL POP', 'INCS33-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Validación y uso del material publicitario dentro del Autoservicio.\r\nOBJETIVO: Genera un diagnóstico validando los diferentes tipos de material existentes en el Autoservicio en el momento de la visita así como su utilidad con el fin de determinar estrategias acertadas de esta publicidad.\r\nMETODOLOGÍA: Investigación cualitativa.\r\nTÉCNICA: Recolección de información y observación.\r\nMUESTRA: Se hace el protocolo de observación para una sección del Autoservicio, toma de registros fotográficos. \r\nREQUERIMIENTOS: Datos de ubicación del Autoservicio, acceso al mismo y autorización para la toma de registros fotográficos.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Entrega informe con conclusiones y recomendaciones, incluye fotos.\r\nPRE-REQUISITO: Exhibición en el punto de venta.', '', NULL, 'ETE0002', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:56:29'),
(10178, 51, 'SERVICIO AL CLIENTE', 'INCS28-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores que tienen contacto con los compradores para brindar un mejor servicio.\r\nOBJETIVO: Brinda  fundamentos para el servicio al cliente  a los colaboradores,  como normas básicas de atención, lenguaje de los gestos y cualidades del servicio, genera  empatía para  mejorar la experiencia del comprador y obtener mayor satisfacción.\r\nMETODOLOGÍA: Seminario - taller.\r\nTÉCNICA: Teórico - práctico.\r\nMUESTRA: Se hace un taller en el Autoservicio para máximo 10 colaboradores, durante un tiempo de dos horas, dónde cada asistente comprende los fundamentos básicos de un buen servicio.\r\nREQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Bogotá, Medellín, Cali, Barranquilla, Pereira, Bucaramanga.\r\nENTREGABLE: Cada asistente recibe una carpeta de contenido y una certificación de asistencia.\r\nPRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', '', NULL, 'FTE0001', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:57:09'),
(10179, 51, 'GESTIÓN DE LA CAJA', 'INCS31-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores que están en la sección de caja, sobre la gestión efectiva de la misma.\r\nOBJETIVO: Profundiza en técnicas de comunicación,  visibilidad y organización de la caja, elementos útiles e inútiles, empacado y estética del producto entregado.\r\nMETODOLOGÍA: Seminario - taller.\r\nTÉCNICA: Teórico - práctico.\r\nMUESTRA: Se hace un taller en el Autoservicio para máximo 5 colaboradores, durante un tiempo de dos horas, dónde cada asistente asume un rol efectivo de cajero.\r\nREQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Cada asistente recibe una carpeta de contenido y una certificación de asistencia.\r\nPRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes o necesidades de cliente.', '', NULL, 'FTE0002', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:57:39'),
(10180, 51, 'PROTOCOLO Y ETIQUETA EN EL SERVICIO', 'INCS30-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores en los principios básicos de la etiqueta empresarial.\r\nOBJETIVO: Brinda  herramientas de etiqueta generando un mejor ambiente dentro de un marco de respeto, abordando temas como las conductas que soportan los valores del Autoservicio, presentación personal en el trabajo, comportamientos apropiados e inapropiados.\r\nMETODOLOGÍA: Seminario - taller.\r\nTÉCNICA: Teórico - práctico.\r\nMUESTRA: Se hace un taller en el Autoservicio para máximo 10 colaboradores, durante un tiempo de dos horas, dónde cada asistente comprende el papel que desempeña su presentación y acciones en el Autoservicio.\r\nREQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Cada asistente recibe una carpeta de contenido y una certificación de asistencia.\r\nPRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', '', NULL, 'FTE0003', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:58:04'),
(10181, 51, 'MANIPULACIÓN DE ALIMENTOS', 'INCS29-2016', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores en el manejo correcto de los alimentos.\r\nOBJETIVO: A través de la capacitación, mejora los procesos de calidad e higiene alimentaria, obteniendo o actualizando el carnet de manipulación de alimentos.\r\nMETODOLOGÍA: Curso.\r\nTÉCNICA: Cátedra.\r\nMUESTRA: Se dicta el curso en el Autoservicio para máximo 10 colaboradores, durante un tiempo de dos horas.\r\nREQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación.\r\nENTREGABLE: Cada asistente recibe su carnet.\r\nPRE-REQUISITO: Ninguno.', '', NULL, 'FTE0004', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 13:58:42'),
(10182, 52, 'SOCIODEMOGRÁFICO (PERFILES Y MISIONES)', 'INCS27-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Define el perfil de clientes del punto de venta desde su sociodemografía. Apoya el proceso de la misión del comprador en el punto de venta, definiendo sus características generales. OBJETIVO: Permite conocer a los clientes que asisten al punto de venta con el fin de desarrollar servicios y productos adecuados al sector en el que se encuentra ubicado. METODOLOGÍA: Investigación cuantitativa. TÉCNICA: Encuestas personalizadas. MUESTRA:Se hace la estructura de la encuesta. 200 encuestas personalizadas, divididas en el término de 5 días dentro del punto de venta. 50 encuestas personalizadas en el sector. REQUERIMIENTOS: Un espacio dentro del establecimiento en el cual se pueda abordar la mayor cantidad de clientes, con el fin de aplicar la encuesta. Así como los elementos de publicidad ya hechos en el punto de venta y elementos en los que hayan pensado. COBERTURA: Nivel nacional. ENTREGABLE: Entrega informe con conclusiones y recomendaciones. PRE-REQUISITO: Tráfico de clientes.', '', NULL, 'CCL0001', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:07:15'),
(10183, 52, 'SATISFACCIÓN CLIENTE', 'INCS03-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Determinar el índice de satisfacción con el fin de validar nuevas estrategias que permitan atraer nuevos clientes. OBJETIVO: Esta investigación permitirá determinar las oportunidades de mejora que presenta el autoservicio, con el fin de fidelizar los clientes ocasionales convirtiéndolos en compradores comunes del establecimiento. METODOLOGÍA: Investigación cualitativa. TÉCNICA: Encuestas personalizadas. MUESTRA: Se hace la estructura de la encuesta. 100 encuestas personalizadas. REQUERIMIENTOS: Un espacio dentro del establecimiento en el cual se pueda abordar la mayor cantidad de clientes, con el fin de aplicar la encuesta y medir su frecuencia de compra, necesidades y expectativas con respecto al establecimiento. COBERTURA: Nivel nacional. ENTREGABLE: Entrega informe con conclusiones y recomendaciones. PRE-REQUISITO: Ninguno.', NULL, NULL, 'CCL0002', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:13:16'),
(10184, 52, 'EXPERIENCIA DE SERVICIO Y TIEMPOS DE ATENCIÓN', 'INCS05-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Revela como tratan los empleados a sus clientes y si el tiempo de servicio es el adecuado.\r\nOBJETIVO: Esta investigación permite medir el nivel de servicio y atención que prestan los empleados del Autoservicio a sus clientes, determinando el nivel de conocimiento de  los  productos y el grado de afinidad con el cliente, con el fin de generar mayor rotación de inventarios para el Autoservicio.\r\nMETODOLOGÍA: Investigación cuali-cuantitativa.\r\nTÉCNICA: Cliente oculto y encuestas.\r\nMUESTRA: Se hace la estructura del protocolo para 6 visitas al punto de venta en cliente oculto y protocolo para 50 encuestas a clientes del punto.\r\nREQUERIMIENTOS: Disponibilidad de acceso al establecimiento sin generar previa alerta sobre el personal.\r\nCOBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. \r\nENTREGABLE: Entrega informe con conclusiones y recomendaciones.\r\nPRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', NULL, NULL, 'CCL0003', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:22:05'),
(10185, 52, 'SONDEO DE PUBLICIDAD', 'INCS09-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Permite tomar decisiones rápidas sobre diversas alternativas publicitarias para el punto de venta. OBJETIVO: A través del análisis de las diferentes técnicas utilizadas por los competidores, determinar la estrategia de mayor impacto en la comunicación hacia el cliente. METODOLOGÍA: Investigación cuali-cuantitativa. TÉCNICA: Recolección de Información en punto de venta. MUESTRA: Se hace la estructura de la encuesta. 150 encuestas personalizadas. REQUERIMIENTOS: Un espacio dentro del establecimiento en el cual se pueda abordar la mayor cantidad de clientes, con el fin de aplicar la encuesta. Así como elementos de publicidad ya hechos en el punto de venta y elementos en los que hayan pensado. COBERTURA: Nivel nacional. ENTREGABLE: Entrega informe con conclusiones y recomendaciones. PRE-REQUISITO: Uso material POP.', NULL, NULL, 'CCL0004', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:26:51'),
(10186, 52, 'NECESIDADES DEL CLIENTE', 'INCS11-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Se definen necesidades para validar estrategias innovadoras. OBJETIVO: Por medio del conocimiento de las necesidades de los clientes se establece un plan de mercadeo para el Autoservicio. METODOLOGÍA: Investigación cualitativa. TÉCNICA: Encuesta telefónica. MUESTRA: Se hace la estructura del cuestionario. 60 llamadas de 5 minutos. REQUERIMIENTOS: Base de datos con datos mínimos de los clientes (nombre, número telefónico). COBERTURA: Nivel nacional. ENTREGABLE: Entrega informe con conclusiones y recomendaciones. PRE-REQUISITO:Satisfacción de cliente o satisfacción de clientes frecuentes.', NULL, NULL, 'CCL0005', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:37:15'),
(10187, 10, 'BONO TOTTO $30.000', 'TOTTO $30.000', 'TOTTO', 'BONO TOTTO $30.000', NULL, NULL, 'BON1328', 0, 0, 0, 0, 1, NULL, '2016-05-24', '2016-05-24', 0, NULL, 12, 1, NULL, 1, 7, '2016-05-24 14:42:50'),
(10188, 52, 'SATISFACCIÓN CLIENTES FRECUENTES', 'INCS01-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Identificar las oportunidades, debilidades y fortalezas del punto de venta para definir estrategias encaminadas a cubrir las expectativas del cliente. OBJETIVO: Esta investigación permitirá determinar las oportunidades de mejora que presenta el Autoservicio, con el fin de satisfacer la expectativas de sus clientes, brindando un análisis acerca de lo que esperan sus clientes y lo que reciben. METODOLOGÍA: Investigación cualitativa. TÉCNICA: Encuesta telefónica MUESTRA: Se hace la estructura del cuestionario. 50 llamadas de 3 minutos. REQUERIMIENTOS: Base de datos de 120 registros, con datos mínimos de los clientes (nombre, número telefónico). COBERTURA: Nivel nacional. ENTREGABLE: Entrega informe con conclusiones y recomendaciones. PRE-REQUISITO: Ninguno.', NULL, NULL, 'CCL0006', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:43:19'),
(10189, 51, 'GESTIÓN DE LA CAJA', 'INCS31-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores que están en la sección de caja, sobre la gestión efectiva de la misma. OBJETIVO: Profundiza en técnicas de comunicación, visibilidad y organización de la caja, elementos útiles e inútiles, empacado y estética del producto entregado. METODOLOGÍA: Seminario - taller. TÉCNICA: Teórico - práctico. MUESTRA: Se hace un taller en el Autoservicio para máximo 5 colaboradores, durante un tiempo de dos horas, dónde cada asistente asume un rol efectivo de cajero. REQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación. COBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. ENTREGABLE: Cada asistente recibe una carpeta de contenido y una certificación de asistencia. PRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes o necesidades de cliente.', NULL, NULL, 'FTE0005', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:50:34'),
(10190, 51, 'SERVICIO AL CLIENTE', 'INCS28-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores que tienen contacto con los compradores para brindar un mejor servicio. OBJETIVO: Brinda fundamentos para el servicio al cliente a los colaboradores, como normas básicas de atención, lenguaje de los gestos y cualidades del servicio, genera empatía para mejorar la experiencia del comprador y obtener mayor satisfacción. METODOLOGÍA: Seminario - taller. TÉCNICA: Teórico - práctico. MUESTRA: Se hace un taller en el Autoservicio para máximo 10 colaboradores, durante un tiempo de dos horas, dónde cada asistente comprende los fundamentos básicos de un buen servicio. REQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación. COBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Bogotá, Medellín, Cali, Barranquilla, Pereira, Bucaramanga. ENTREGABLE: Cada asistente recibe una carpeta de contenido y una certificación de asistencia. PRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', NULL, NULL, 'FTE0006', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 14:55:41'),
(10191, 51, 'PROTOCOLO Y ETIQUETA EN EL SERVICIO', 'INCS30-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores en los principios básicos de la etiqueta empresarial. OBJETIVO: Brinda herramientas de etiqueta generando un mejor ambiente dentro de un marco de respeto, abordando temas como las conductas que soportan los valores del Autoservicio, presentación personal en el trabajo, comportamientos apropiados e inapropiados. METODOLOGÍA: Seminario - taller. TÉCNICA: Teórico - práctico. MUESTRA: Se hace un taller en el Autoservicio para máximo 10 colaboradores, durante un tiempo de dos horas, dónde cada asistente comprende el papel que desempeña su presentación y acciones en el Autoservicio. REQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación. COBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. ENTREGABLE: Cada asistente recibe una carpeta de contenido y una certificación de asistencia. PRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', NULL, NULL, 'FTE0007', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 15:03:25'),
(10192, 51, 'MANIPULACIÓN DE ALIMENTOS', 'INCS29-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Capacita a los colaboradores en el manejo correcto de los alimentos. OBJETIVO: A través de la capacitación, mejora los procesos de calidad e higiene alimentaria, obteniendo o actualizando el carnet de manipulación de alimentos. METODOLOGÍA: Curso. TÉCNICA: Cátedra. MUESTRA: Se dicta el curso en el Autoservicio para máximo 10 colaboradores, durante un tiempo de dos horas. REQUERIMIENTOS: Un espacio adecuado dentro del establecimiento en el cual se pueda capacitar a los colaboradores, con acceso a proyectar una presentación. ENTREGABLE: Cada asistente recibe su carnet. PRE-REQUISITO: Ninguno.', NULL, NULL, 'FTE0008', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 15:07:23'),
(10193, 50, 'EXHIBICIÓN EN PUNTO DE VENTA', 'INCS32-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Identificar la exhibición en el punto de venta, el manejo actual de la misma y su impacto. OBJETIVO: Genera un diagnóstico del uso de las exhibiciones sobre la cara de góndola, tope o punta de góndola, base de góndola y entrepaños con el fin de garantizar tanto en el vertical como en el horizontal las caras del producto así como la visibilidad. METODOLOGÍA: Investigación cualitativa. TÉCNICA: Recolección de información y observación. MUESTRA: Se hace el protocolo de observación para una sección del Autoservicio, toma de registros fotográficos. REQUERIMIENTOS: Datos de ubicación del Autoservicio, acceso al mismo y autorización para la toma de registros fotográficos. COBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. ENTREGABLE: Entrega informe con conclusiones y recomendaciones, incluye fotos. PRE-REQUISITO: Satisfacción de cliente o satisfacción de clientes frecuentes.', NULL, NULL, 'ETE0003', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 15:14:22'),
(10194, 50, 'USO DEL MATERIAL POP', 'INCS33-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Validación y uso del material publicitario dentro del Autoservicio. OBJETIVO: Genera un diagnóstico validando los diferentes tipos de material existentes en el Autoservicio en el momento de la visita así como su utilidad con el fin de determinar estrategias acertadas de esta publicidad. METODOLOGÍA: Investigación cualitativa. TÉCNICA: Recolección de información y observación. MUESTRA: Se hace el protocolo de observación para una sección del Autoservicio, toma de registros fotográficos. REQUERIMIENTOS: Datos de ubicación del Autoservicio, acceso al mismo y autorización para la toma de registros fotográficos. COBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. ENTREGABLE: Entrega informe con conclusiones y recomendaciones, incluye fotos. PRE-REQUISITO: Exhibición en el punto de venta.', NULL, NULL, 'ETE0004', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 15:17:36'),
(10195, 48, 'POSICIONAMIENTO EN EL SECTOR', 'INCS23-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Identifica el nivel de recordación y posicionamiento del Autoservicio. OBJETIVO: Por medio de este estudio se puede determinar el nivel de fidelización, aceptación y recordación que tiene el Autoservicio en el sector. METODOLOGÍA: Investigación cuantitativa. TÉCNICA: Recolección de Información en campo. MUESTRA: Se hace la estructura la encuesta. Se encuestan 100 clientes y 100 transeúntes del sector. REQUERIMIENTOS: Dirección Autoservicio. COBERTURA: Nivel nacional. ENTREGABLE: Entrega informe con conclusiones y recomendaciones. PRE-REQUISITO: Tráfico de clientes.', NULL, NULL, 'ALC0004', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 15:22:19'),
(10196, 48, 'TRÁFICO DE CLIENTES', 'INCS24-2016PN', 'INCSEARCH', 'NECESIDADES QUE CUBRE: Determina momentos de compra con el fin de fijar estrategias promocionales. OBJETIVO: Esta investigación determina y compara el tráfico de clientes de cada uno de los competidores con el fin de determinar estrategias para aumentar las ventas en horas estacionales. METODOLOGÍA: Investigación cuantitativa. TÉCNICA: Recolección de Información en campo MUESTRA: Se hace la planeación de la actividad. Se monitorean 6 puntos de venta por un periodo de 4 horas en el mismo día, incluye el mismo punto de venta. REQUERIMIENTOS: Dirección Autoservicio. Selección del horario de evaluación. COBERTURA: Sólo aplica para puntos que estén ubicados dentro del perímetro urbano de Barranquilla, Bogotá, Bucaramanga, Cali, Cúcuta, Medellín y Pereira. ENTREGABLE: Entrega informe con conclusiones y recomendaciones. PRE-REQUISITO: Sociodemográfico (Perfiles y misiones)', NULL, NULL, 'ALC0005', 0, 0, 0, 0, 1, 16, '2016-05-24', '2016-05-24', 1, 0, 0, 1, NULL, 2, 152, '2016-05-24 15:26:09'),
