(10226, 11, 'Coche para bebe 4 en 1 coleccion Monroe', '1838265', 'GRACO', 'El coche de Graco, posee mecanismo de cierre automático que permite que se pare por sí mismo cuando esta plegado. Amplia bandeja frontal con espacio para portavasos del bebé y práctica bandeja superior, para los padres, con compartimientos convenientes para almacenamiento. Tienen ruedas frontales con suspensión giratoria y frenos independientes en cada una, espaldar ajus multi posiciones, arnés de seguridad y apoya pies. Incluye porta bebé que se ajusta como asiento de auto (con base) y amplia canastilla para llevar los artículos del bebé Es apto para tu bebé entre los 0 y 5 años', NULL, NULL, 'NIN0256', 0, 0, 0, 0, 1, 16, '2016-06-03', '2016-06-03', 1, 120000, 26, 1, NULL, 2, 13, '2016-06-03 16:56:41'),
