(10686, 13, 'GAFAS DE REALIDAD VIRTUAL', 'VR Box', 'GENERICO', 'Las gafas VR Box nos llegaron con una especie de pequeño mando que nos permitirá interactuar con la pantalla de nuestro smartphone cuando esté colocado dentro. Tal es así que nos da la posibilidad de que en un futuro podamos disfrutar de juegos como nunca antes hemos visto. Estas gafas son compatibles con teléfonos que van desde las 4.7 a las 6 pulgadas de pantalla.\r\n\r\nSon muy cómodas, ya que vienen con una goma para que se sujeten ellas solas, sin tener que estar sujetándolas. Además, son acolchadas, por lo que olvidamos las marcas extrañas en la cara después de pasar horas con ellas puestas. Además, como dato relevante, debemos avisar de que se pueden regular los cristales, es decir, puedes moverlos hacia delante o hacia atrás e incluso a los lados, ya que no todas las personas tienen la misma forma de cara.\r\n\r\nEn cuanto a la sujeción del teléfono, las VR Box vienen con unas almohadillas que podremos pegar en el habitáculo donde colocaremos nuestro móvil para que no se ralle ni quede ningún botón apretado, una muy buena idea.', '', NULL, 'TEC1623', 0, 0, 0, 0, 1, 16, '2016-07-18', '2016-08-09', 1, 26000, 16, 1, NULL, 2, 13, '2016-08-09 17:49:48'),
