(10697, 5, 'ALMOHADA ALOE VERA', 'ALMALO', 'GENERICO', '"La almohada es un artículo indispensable a la hora de dormir o descansar, pues ésta almohada te permite un fácil y correcto apoyo de la cabeza, evitando problemas cervicales a futuro. Éste producto está elaborado en un material resistente y de alta calidad, evitando la formación de bacterias y ácaros.\r\nSuavidad y confort.\r\n\r\nLas almohadas Aloe Vera mantienen su estructura voluminosa, ligera y ergonómica para un buen apoyo de la cabeza al descansar. Cuenta con cualidades únicas, siendo un producto indeformable y anti-alérgico. Éstas te facilitan un fácil cuidado y limpieza, garantizando de esta manera mayor tiempo de vida, siendo seguras y recomendadas para toda la familia."', NULL, NULL, 'HOG1833', 0, 0, 0, 0, 1, 16, '2016-07-18', '2016-07-18', 1, 20000, 26, 1, NULL, 2, 13, '2016-07-18 12:14:51'),
(10698, 5, 'MAQUINA PARA HACER HELADOS', 'ICEMAKER', 'GENERICO', 'Es una máquina liviana y pequeña que viene prácticamente lista para ser utilizada. Lo único que hay que hacer cuando sale de la caja, es colocarle la base que se hace con un click, y ponerle la fuente para las frutas en la parte superior, que también es muy sencillo.  Es necesario que tus hijos tengan espacios de diversión y entretenimiento  para su sano desarrollo, por tal motivo hemos traído para la línea infantil este espectacular Máquina de helados, un producto que permite el desarrollo lúdico y  creativo de tus hijos en sus tiempo libres, no representa ningún tipo de peligro  y está diseñado precisamente para su edad, con el puedes preparar helados en  tan sólo tres minutos y luego consumirlos, ¡es fácil!.', NULL, NULL, 'HOG1834', 0, 0, 0, 0, 1, 16, '2016-07-18', '2016-07-18', 1, 29000, 26, 1, NULL, 2, 13, '2016-07-18 12:32:37'),
