(10700, 13, 'ESCOBA ELECTRICA', 'SWILVEL SWEEPER', 'GENERICO', '"Limpiar dejará de ser una pesadilla, con la nueva escoba eléctrica Walter Sweeper, podrá limpiar al máximo cualquier superficie de su hogar u oficina, sin mucho esfuerzo. La Walter Sweeper, ha sido desarrollada con la más alta tecnología, combina un cepillo rotatorio frontal para recoger partículas y pelos con una sola pasada, a la vez que, la mopa de la parte posterior recoge todo rastro de polvo y suciedad del lugar. ¡Todo con un solo aparato y en una sola pasada!\r\nLa increíble Walter Sweeper puede trabajar sin parar durante 45 minutos, si está totalmente cargada, lo que le permitirá una limpieza total en muy poco tiempo, además es muy liviana y fácil de transportar. Y con su práctico recipiente para la suciedad, la Walter Sweeper no deja rastros de polvo al pasar, así que, ya no necesitará de los molestos recogedores, logrando el trabajo de 3 instrumentos en una sola pasada. La escoba eléctrica Walter Sweeper, puede ser usada sobre cualquier superficie, y puede ser utilizada con o sin la mopa. Si utiliza la mopa desmontable se asegurará una efectiva recogida de partículas y polvo."\r\nProducto sujeto a cambios por el proveedor.', NULL, NULL, 'TEC1629', 0, 0, 0, 0, 1, 16, '2016-07-18', '2016-07-18', 1, 25000, 26, 1, NULL, 2, 13, '2016-07-18 14:13:18'),
