(11251, 10, 'TARJETA RECARGABLE LIVERPOOL', 'Expedición monedero', 'liverpool', 'Tarjeta Recargable  Electrónica Liverpool Válido Para Utiliza El Monedero Electrónico en las boutiques de Aeropostale, GAP, MAC y Banana Republic. El Monedero Electrónico puede ser recargable, no es reembolsable ni se puede canjear por dinero en efectivo. Cuenta con una vigencia de 2 años a partir de su fecha de activación. Aplica en almacenes a nivel nacional, excepto en concesionarias dentro de los almacenes de Liverpool y Fábricas de Francia.  Los certificados de compra se entregan inactivos por su seguridad. El tiempo de activación es de 4 días hábiles después de recibirlo.', '', NULL, 'BON1443', 0, 0, 0, 0, 1, 16, '2016-08-05', '2016-08-08', 1, 7, 10, 1, NULL, 2, 191, '2016-08-08 14:58:01'),
(11252, 10, 'TARJETA RECARGABLE SEARS', 'Expedición monedero', 'Sears', 'Tarjeta Recargable Sears válido. Esta tarjeta no es de crédito. El saldo que ampara no podrá ser abonado a una cuenta de crédito. Únicamente podrá ser utilizado para adquirir mercancías en nuestros almacenes a nivel nacional, excepto Outlet Sears Vallejo, Outlet Sears Pachuca Plaza Perisur, Outlet Sears Otay. Los certificados de compra se entregan inactivos por su seguridad.', '', NULL, 'BON1444', 0, 0, 0, 0, 1, 16, '2016-08-05', '2016-08-08', 1, 7, 10, 1, NULL, 2, 191, '2016-08-08 14:57:28'),
(11253, 10, 'TARJETA RECARGABLE SÍ VALE', 'Expedición monedero', 'Sí vale', 'Tarjeta Recargable Sí Vale. La Tarjeta Lealtad es aceptada en cualquier establecimiento del mundo que cuente con terminal bancaria como: Tiendas Departamentales, Aerolíneas, Compras por Internet o por teléfono, Autoservicios, Farmacias, Tiendas de conveniencia, Clubes de Mayoristas, Librerías, Ópticas, Zapaterías, Agencias de automóviles, Gasolineras, Restaurantes, Escuelas, Agencias de viajes. Visita www.sivale.mx para conocer promociones, beneficios, etc. <p>*El tiempo de activación es de 4 días hábiles después de recibirlo.<p>La vigencia del certificado es de un año a partir de la fecha de recepción.', '', NULL, 'BON1445', 0, 0, 0, 0, 1, 16, '2016-08-05', '2016-08-08', 1, 7, 10, 1, NULL, 2, 191, '2016-08-08 14:57:03'),
(11254, 10, 'TARJETA RECARGABLE EL PALACIO DE HIERRO', 'Expedición monedero', 'El Palacio de Hierro', 'Tarjeta Recargable El Palacio de Hierro Válido en cualquiera de nuestras tiendas de El Palacio de Hierro, Boutiques Palacio, Casa Palacio, Viajes palacio, Aldo, Bebe, Burberry, Mango, Springfield y Women Secret. Esta tarjeta no es de crédito. No aplica para el pago de tarjetas de crédito palacio. El Palacio de Hierro no se hace responsable en caso de robo, extravío o mal uso de la misma. Toda compra realizada con este certificado no se podrá facturar. El certificado no es reembolsable ni se puede canjear por dinero en efectivo. Certificado no válido en tiendas Outlet, Restaurantes Palacio y en la compra de tarjetas iTunes.  El tiempo de activación es de 4 días hábiles después de recibirlo. La vigencia del certificado es de un año a partir de la fecha en que fue recibido. "Los Monederos de Palacio de Hierro pueden llegar en un tono o imágenes diferentes al publicado".', '', NULL, 'BON1446', 0, 0, 0, 0, 1, 16, '2016-08-05', '2016-08-08', 1, 7, 10, 1, NULL, 2, 191, '2016-08-08 14:56:28'),
(11255, 10, 'TARJETA RECARGABLE WALMART', 'Expedición monedero', 'Walmart', 'Tarjeta Recargable  Electrónica Walmart. Esta tarjeta no es de crédito, sólo puede ser utilizada como medio de pago de mercancía que se comercializa en las tiendas Walmart, Bodega Aurrerá, Mi Bodega, Superama, Sam´s Club, Suburbia. No será canjeado por dinero en efectivo, ni podrá aplicarse como forma de pago de tarjeta de crédito o cualquier otro servicio. Esta tarjeta es válida únicamente en la República Mexicana. El tiempo de activación es de 4 días hábiles después de recibirlo.La vigencia del certificado es de un año a partir de la fecha de recepción.', '', NULL, 'BON1447', 0, 0, 0, 0, 1, 16, '2016-08-05', '2016-08-08', 1, 7, 10, 1, NULL, 2, 191, '2016-08-08 14:55:51'),
