(4847, 29, 'GIMNASIO INFANTIL', 'REF: M3185 COD: 9321104815828', 'FISHER PRICE', 'Este gimnasio de plástico tiene tres posiciones ajustables: para que el bebé juegue o permanezca boca abajo. En el centro del gimnasio hay una tortuga que tiene un espejo con luces alrededor. Incluye tres juguetes colgantes: un caracol con cuentas a manera de sonaja, un pollito con castañuelas y una rana con brazos y patas suaves. La tortuga cuenta con música y efectos de sonido. Incluye un interruptor con regulador de volumen.   Edad: 0m+', '100063', 0, 'INF0004', 0, 0, 0, 0, 2, 12, '2015-05-26', '2015-05-26', 1, 14, 0, 1, 'GIMNASIOINFANTILFISHERPRICE', 2, 225, '2016-06-17 10:54:51'),
(4848, 29, 'BARBIE', 'REF: BDB35 COD:0746775297282', 'MATTEL', 'Barbie Diseña Vestidos con Estilo permite a las niñas diseñar conjuntos de ropa reales para la muñeca Barbie. Las niñas pueden elegir un vestido para decorar, colorear y embellecer utilizando esténciles y marcadores de tela, ¡después pueden recortar la orilla del papel para cerrar un conjunto de ropa real y único para la muñeca Barbie! Incluye a una muñeca Barbie, cuatro conjuntos de ropa lisos, un vestido (empacado en la muñeca), dos esténciles de plástico, una planilla holográfica, tres marcadores de color, un par de zapatos y un collar. ', '100064', 0, 'INF0005', 0, 0, 0, 0, 1, 12, '2015-05-26', '2015-05-26', 1, 0, 0, 1, 'BARBIEMATTEL', 2, NULL, NULL),
(4849, 29, 'TRANSFORMERS', 'REF: A6513 - A2086 COD: 203865210005', 'HASBRO', 'Transformes construye tu héroe favorito de Transformers, en modo vehículo o robot con este conjunto de 2-en-1.', '100065', 0, 'INF0006', 0, 0, 0, 0, 1, 12, '2015-05-26', '2015-05-26', 1, 0, 0, 1, 'TRANSFORMERSHASBRO', 2, NULL, NULL),
(4850, 29, 'SILLA DE COMER ', 'REF: 0840101231381', 'BORN', 'Se ajusta a siete alturas y se reclina en tres posiciones para comodidad del bebé a la hora de alimentarlo. La bandeja se saca con una sola mano y se limpia igual de convenientemente; la almohadilla del asiento es resistente a los derrames; la bandeja para alimentos (y las correas) se pueden desinfectar en la máquina lavaplatos.', '100066', 0, 'INF0007', 0, 0, 0, 0, 1, 14, '2015-05-26', '2016-06-17', 1, 16, 0, 3, 'SILLADECOMERBORN', 2, 225, '2016-06-17 10:55:38'),
