(6055, 7, 'LOCIÓN ADIDAS DYNAMIC+LOCIÓN BENETTON COLORS+EL HOMBRE DE CALVIN KLEIN PARA HOMBRES', 'B002EZG44A/124311/ASIN: B0012RQZGS', 'ADIDAS  BENETTON CALVIN KLEIN', 'LANZADO AL MERCADO POR LA CASA DE DISEÑO DE ADIDAS EN 1997, ADIDAS DYNAMIC PULSE ES UNA FRAGANCIA MASCULINA QUE POSEE UNA MEZCLA DE UN FRESCO AROMA DE CÍTRICOS, CEDRO Y MENTA CON TONOS BAJOS DE FRUTAS DULCES, MADERAS FRAGANTES Y HABA TONKA. DE 3.4 OZ, PRODUCTO SUGETO A CAMBIOS POR EXISTENCIA EN EL INVENTARIO.+COLORS DE BENETTON DE BENETTON ES UNA FRAGANCIA DE LA FAMILIA OLFATIVA ORIENTAL PARA MUJERES.  LAS NOTAS DE SALIDA SON SALVIA DE EGIPTO, NEROLI, JACINTO FRANCÉS Y ALBAHACA DE ISRAEL; LAS NOTAS DE CORAZÓN SON MARACUYÁ (FRUTA DE LA PASIÓN), NARDOS, PIÑA, DURAZNO (MELOCOTÓN), JAZMÍN Y ROSA DE BULGARIA (ROSA DAMASCENA DE BULGARIA); LAS NOTAS DE FONDO SON ALGALIA (CIVET), OPOPÓNACO, PACHULÍ CHINO, CEDRO, VAINILLA DE MADAGASCAR Y MUSGO DE ROBLE. DE 3.4 OZ. PRODUCTO SUGETO A CAMBIOS POR EXISTENCIA EN EL INVENTARIO.+ USTED VA A OLER LA ESENCIA DE LA MASCULINIDAD SI VA A TOMAR SU EJEMPLO DE EL NOMBRE DE LA FRAGANCIA. EL EMBALAJE ES ELEGANTE, MODERNISTA, CON UN SENTIDO ARQUITECTÓNICO DE PROPORCIONES Y SE VE BIEN. PRODUCTO SUGETO A CAMBIOS POR EXISTENCIA EN EL INVENTARIO.', '', 1, 'PER1135', 0, 0, 0, 0, 1, 16, '2015-09-01', '2015-09-01', 1, 11000, 25, 1, 'P39', 2, NULL, NULL),
