(6136, 13, 'Iphone 5 S', '16GB', 'APPLE', '640 X 1136 PIXELS, 4.0 PULGADAS, POLIFÓNICO, MP3 El Apple iPhone 5S sucede al iPhone 5 conservando el aspecto exterior, pero introduciendo un nuevo chip A7 de 64 bits que mejora la performance en más del doble según Apple. Conserva la pantalla Retina de 4 pulgadas, pero agrega también un chip dedicado a movimientos, para una nueva generación de aplicaciones. También incorpora un sensor de huellas dactilares en el botón de inicio, que permite incrementar la seguridad del teléfono. Su cámara conserva los 8 megapixels pero esta vez con pixels de 1.5 micrones, y apertura ƒ/2.2, y está disponible en versiones de 16 GB de almacenamiento interno.', '', 1, 'TEC1011', 0, 0, 0, 0, 1, 16, '2015-09-01', '2016-06-14', 1, 45455, 15, 1, 'T24', 2, 296, '2016-06-14 15:37:36'),
(6137, 7, 'CEPILLO CON CERDAS DE JABALI', 'SB3', 'MASON PERSON', 'Jabalí Sensible cepillo de cerdas de pelo. Único almohadilla de goma-amortiguador permite el cepillado eficaz y eficiente. Fácil de usar, masajea suavemente el cuero cabelludo. Para el cabello fino y el cuero cabelludo sensible.', '', 1, 'PER1150', 0, 0, 0, 0, 2, 16, '2015-09-01', '2015-09-01', 1, 25000, 25, 1, 'P54', 2, 13, '2015-10-27 08:21:53'),
(6138, 7, 'KIT PREMIUM X 15 BROCHAS', 'B003GCZOX2', 'SIGMA', 'El Kit Premium contiene quince cepillos de calidad de la firma de la cara, los ojos y los labios. Estos cepillos son únicos, versátil y el complemento perfecto para completar su colección de pincel.', '', 1, 'PER1151', 0, 0, 0, 0, 2, 16, '2015-09-01', '2015-09-01', 1, 25000, 25, 1, 'P55', 2, 13, '2015-10-27 08:22:45'),
(6139, 7, 'SISTEMA DOMÉSTICO DE DEPILACIÓN IPL', 'B00JY9CSWG', 'VEET', 'Veet Infini''Silk Pro Light-Based IPL En el sistema doméstico de depilación IPL utiliza misma tecnología que se encuentra en las clínicas y salones. Esta tecnología de punta ofrece resultados de reducción de pelo permanente en tan sólo 4 a 5 tratamientos. Ideal para la eliminación del vello de todo el cuerpo, incluso los brazos, axilas, línea del bikini, piernas, espalda y pecho. Diseñado tanto para mujeres como la depilación hombres''. Incluye sensor de color de la piel, sensor de contacto con la piel, 5 niveles de energía de luz y el funcionamiento con cable.', '', 1, 'PER1152', 0, 0, 0, 0, 2, 16, '2015-09-01', '2015-09-01', 1, 25000, 25, 1, 'P56', 2, 13, '2015-10-27 08:23:55'),
(6140, 7, 'PERFUME DAMA GUESS GOLG', '148463', 'GUESS', 'Lanzado por la casa de diseño de Guess favor consideran que hay varios factores que pueden afectar el olor natural de la piel y, a su vez, la forma en que un olor olores en usted. Por ejemplo, su estado de ánimo, el nivel de estrés, la edad, la química del cuerpo, la dieta y los medicamentos actuales todos pueden alterar los olores que usa. Del mismo modo, el factor tal como la piel seca o grasa incluso puede afectar a la cantidad de tiempo que va a durar una fragancia después de ser aplicado', '', 1, 'PER1153', 0, 0, 0, 0, 2, 16, '2015-09-01', '2015-09-01', 1, 50000, 25, 1, 'P57', 2, 13, '2015-10-27 08:24:30'),
(6141, 7, 'RELOJ TISSOT', 'TIST0332101611100', 'TISSOT', 'CAJA DE ACERO INOXIDABLE CON UNA CORREA DE CUERO BLANCO MADRE DE LÍNEA DE PERLAS CON LAS MANOS TONO DE PLATA Y MARCADORES DE HORA DE ÍNDICE MOVIMIENTO DE CUARZO DIÁMETRO: 28 MM RESISTENTE AL AGUA HASTA 99 PIES PRODUCTO SUJETO A CAMBIOS POR EXISTENCIA EN EL INVENTARIO ,IMAGEN ILUSTRATIVA PUEDE LLEGAR EN CUALQUIERA DE LAS PRECENTACIONES, VALIDO POR UNA UNIDAD. ', '', 1, 'PER1154', 0, 0, 0, 0, 1, 16, '2015-09-01', '2015-09-01', 1, 25000, 25, 1, 'P58', 2, NULL, NULL),
