(6771, 13, 'PARLANTE USB SW-U GENIUS 2.1 200', 'USB SW-U', 'Genius', 'Parlantes de graves con conexión USB Genius presenta el primer sistema de parlantes de graves con alimentación vía USB, los SW-U2.1 200. Los parlantes secundarios tienen una unidad de cobre de 2.5 pulgadas dentro de un panel con terminación en negro brillante. Además, su diseño con enganche posterior le permite colgarlos si así lo desea. Los SW-U2.1 200 tienen una unidad de graves de 3 pulgadas en un gabinete de madera para lograr una gran calidad de sonido. Son ideales para su PC, computadora portátil y cualquier otro dispositivo de audio que utilice cables de audio de 3.5mm. La perilla de volumen en la unidad de graves permite un sencillo control.', '', NULL, 'TEC1065', 0, 0, 0, 0, 1, 16, '2015-10-21', '2015-11-12', 1, 25000, 15, 1, NULL, 2, 4, '2015-11-12 06:48:09'),
