(7395, 19, 'ICON SQUAD 3 MOCHILA - NEGRO', 'ICON SQUAD 3 ', 'ICON', 'Maletas, lanzar ... es cómo vivimos. Cuando el momento llama, es el momento de error y golpeó el asfalto con todo el equipo necesario en el remolque. Para lograr esto, hemos diseñado el ICONO Squad 3 Mochila específicamente para aquellos que montar día-en-día-out. Revisada y reinventado para la rutina diaria a velocidades legalish. Gráficos actualizados, un bolsillo portátil específico, sistema único de cierre frontal, materiales reflectantes de 360 ​​grados y nuestro Tri-Fit Sistema de cierre del icono. Es una mochila construida con el piloto en mente. * Mientras que el Squad3 está construido con telas resistentes al agua, es muy recomendable el uso de una bolsa seca del mercado de accesorios para cualquier equipo electrónico.', NULL, 1, 'MOT0004', 0, 0, 0, 0, 1, 16, '2015-11-18', '2015-11-18', 1, 0, 16, 1, 'MOT4', 2, NULL, NULL),
