(7401, 19, 'OGIO MACH 5 BOLSA', 'OGIO MACH 5 ', 'OGIO', 'Exterior moldeado de una sola pieza la hace casi impermeable y no se deforma. Las correas de los hombros se ajustan al cuerpo e incrementan la aerodinamica Espuma acolchada en el area de la espalda para mayor comodidad. Incluye diseño de alta tecnologia para incrementar el flujo de aire. Correas suaves en el cuello y los hombros para mayor comodidad Logo y delineamiento reflectivo Bolsito de cintura removible La hevilla de la correa no esta en el centro, lo que evita rayar el tanque Bolsillo personal para electronicos/articulos valiosos Compartimiento principal grande con divisores Organizador de lujo con bolsillo de seguridad y malla elastica Compartimiento especial para los zapatos Bolsillo interior acolchado para visor adicional Interior rojo de alta visibilidad Correas de hombros ergonomicas ajustables con sistema de apertura de emergencia Correa de pecho ajustable y removible Sistema integrado para cargar el casco Compartimiento para portatil con cierre elastico (le sirve a la mayoria de portatiles de hasta 16 pulgadas Compartimiento acolchado para Ipad/Tablet Compatible con vejiga de hidratacion', NULL, 1, 'MOT0010', 0, 0, 0, 0, 1, 16, '2015-11-18', '2015-11-18', 1, 0, 16, 1, 'MOT11', 2, NULL, NULL),
(7402, 19, 'CHAQUETA ICON WOMEN MERC JACKET ', 'ICON WOMEN MERC JACKET BLACK  ICON WOMEN MERC JACKET PINK', 'ICON', 'Ajuste relajado Chasis suave con paneles re-enforzados en nylon Resistente al agua (lluvia suave) Protecteres de impacto D3O en los codos, hombros y espalda Graficos Sublimados Cierres en la axila para ventilacion Mangas deportivas Canal para los audifonos Cierres YKK Liner fijo', NULL, 1, 'MOT0011', 0, 0, 0, 0, 1, 16, '2015-11-18', '2015-11-18', 1, 0, 16, 1, 'MOT12', 2, NULL, NULL),
(7403, 19, 'AGV K3 CREW ', 'AGV K3 CREW BLANCO/GRIS/ROSADO  AGV K3 CREW BLANCO/GRIS/VERDE', 'AGV ', 'El K-3 is es de los mejores cascos basicos de AGV. Un diseño similar al GP-Tech  y graficos de Valentino Rossi hacen de este casco el ideal para moteros jovenes y los fans del motociclismo. Siendo el unico casco integral en carcasa termoplastica ofrecido por AGV, es la opcion perfecta para los moteros en busca de un casco seguro, de alta calidad, un look excepcional a un precio justo. El diseño del K-3 esta inspirado por los ultimos diseños desde el Stealth, S-4, y el Ti-Tech hasta el Blade/Blade LX y el GP-Tech, cascos que han definido el estilo de la marca.replaced are equally evident. ', NULL, 1, 'MOT0012', 0, 0, 0, 0, 1, 16, '2015-11-18', '2015-11-18', 1, 0, 16, 1, 'MOT13', 2, NULL, NULL),
