(7558, 11, 'F-P Adorable Animals Silla de Bebé', 'V8604', 'MATTEL', 'Esta mecedora ofrece al bebé comodidad y diversión. Tiene una barra suave y removible con 3 divertidos juguetes de plástico. Incluye modo de vibración para relajación del bebé.', NULL, 1, 'NIN0183', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni1', 2, NULL, NULL),
(7559, 9, 'Fp Go Baby Go Pelota Musical', 'M4045', 'MATTEL', 'Es un adorable monito que se balancea en la parte superior. Cuando el bebé golpea al mono la pelota gira y este se mueve y blancea. El bebé es recompensado con divertidas melodías y efectos de sonido.', NULL, 1, 'JUG0644', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni2', 2, NULL, NULL),
(7560, 11, 'F-P Ríe y Aprende Perrito Piano de Aprendizaje', 'W9773', 'MATTEL', 'Tiene tres modalidades de juego: Aprendizaje, Música y Modo Bilingüe; el bebé podrá aprender colores, números, animales, sonidos, partes del rostro, saludos y sus primeras palabras tanto en español como en inglés. Al presionar las teclas escuchará notas de piano y puede crear su propia canción o aprender los animales y sus sonidos, cada tecla tiene un animal diferente. Además al presionar la nariz del perrito escuchará doce canciones diferentes y verá su nariz iluminarse.', '', 1, 'NIN0184', 0, 0, 0, 0, 1, 16, '2015-11-25', '2016-01-08', 1, 14000, 11, 1, 'ni3', 2, 13, '2016-01-08 16:54:17'),
(7561, 9, 'F-P Little People Wheelies Rampa Rascacielos', 'BGC34', 'MATTEL', '¡A más de 90 centímetros altura, esta rampa proporciona grandes momentos de diversión en curva! Tu pequeño corredor saldrá de la rampa en la parta más alta y usara los caminos al azar mediante mecanismos que llevaran el auto por los diferentes caminos. ¿Saldrá velozmente por una de las salidas o brincara por la rampa central? El juego es complementado con una grúa, letrero de alto, una gasolinera y un parquímetro. ¡Tú pequeño disfrutará sin parar!', NULL, 1, 'JUG0645', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni4', 2, NULL, NULL),
(7562, 11, 'F-P Bongos Musicales', 'K8845', 'MATTEL', 'Los Bongos Musicales le ofrecen al bebé dos divertidos modos para jugar. En el modo de sentado, el bebé le puede pegar a los dos bongos y obtener ritmos musicales y efectos de sonido. Con una sencilla conversión los dos bongos se vuelven un juguete para que gatee con él. En el modo de gateo, el bebé es recompensado con música y efectos de sonido mientras empujan y gatean detrás del juguete que rueda. ', NULL, 1, 'NIN0185', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni5', 2, NULL, NULL),
(7563, 9, 'Barbie Sirena Burbujas Mágicas', 'CFF49', 'MATTEL', '¡Esta magnífica sirena hace burbujas y más burbujas! ¡Por primera vez, las niñas pueden crear su propio mundo de fantasía con esta fantástica característica! Jala la cuerda en su espalda para que su cola de sirena gire y cree un mar de burbujas! Cualquier solución para hacer burbujas funcionará. Incluye un cepillo, una tiara y un kit para hacer burbujas.', NULL, 1, 'JUG0646', 0, 0, 0, 0, 2, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni6', 2, 13, '2015-12-01 08:58:45'),
(7564, 9, 'Barbie Entrenando a sus Mascotas', 'BHG13', 'MATTEL', 'Es un surtido de dos diferentes mascotas. Barbie® podrá darle de comer a ellas y así entrenarlas para que sean las más educadas. Ambas contienen un mecanismo interno que le permitirá a las niñas simular el entrenamiento completo. Incluye la muñeca, su mascota y otros accesorios. Cada muñeca se vende por separado.', '', 1, 'JUG0647', 0, 0, 0, 0, 1, 16, '2015-11-25', '2016-01-08', 1, 12000, 11, 1, 'ni7', 2, 13, '2016-01-08 17:03:51'),
(7565, 9, 'Barbie Glitz Surtido', 'T7580', 'MATTEL', 'Este surtido cuenta con increíbles vestidos de noche con telas brillantes. Incluye una bolsa y diferentes accesorios para Barbie®.', NULL, 1, 'JUG0648', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni8', 2, NULL, NULL),
(7566, 9, 'HOT WHEELS PISTA DUELO DE T-REX', 'X2700', 'MATTEL', 'Impulsa tu auto con el lanzador y decide entre los diferentes caminos para poder escapar y evitar caer en la boca de t-rex ya que, si lo haces, te comerá sin compasión. incluye un auto hot wheels. puede conectarse con otros playsets y pistas.', '', 1, 'JUG0649', 40, 30, 8, 4, 1, 16, '2015-11-25', '2016-04-26', 1, 22347, 35, 1, 'ni9', 2, 13, '2016-04-26 15:54:08'),
(7567, 9, 'F-P Imaginext Dragón', 'W9554', 'MATTEL', '¡Este feroz y poderoso dragón no es un dragón ordinario, cuando presionas su palanca cuenta con una poderosa cabeza que se mueve y fácilmente recoge cualquier cosa que se encuentre en su camino. Cuando levantas al dragón por el asa, sus alas se extienden agilizando su conquista de los cielos para aterrorizar al reino. Cuenta con divertidas características luminosas y sonidos increíbles.', NULL, 1, 'JUG0650', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni10', 2, NULL, NULL),
(7568, 9, 'Barbie Clóset de Lujo con Muñeca ', 'BMC00', 'MATTEL', '¡El clóset de Barbie® es el lugar perfecto para que Barbie® pueda escoger un increíble atuendo! Diseñado con toques de color rosa, este closet tiene un increíble diseño, puertas con ventana, y una asa para transportarlo. Ábrelo para descubrir espacios como repisas, cajones y seis perchas para colgar ropa. Incluye una muñeca Barbie® que usa un increíble vestido y zapatos, un segundo vestido y par de zapatos, una bolsa, un collar, y unos lentes. ¡El clóset tiene un lugar para guardar a Barbie® y llevar la diversión y la moda a todos lados!', '', 1, 'JUG0651', 0, 0, 0, 0, 1, 16, '2015-11-25', '2016-01-08', 1, 15000, 11, 1, 'ni11', 2, 13, '2016-01-08 17:11:13'),
(7569, 9, 'HW Bahía Serpiente', 'P3892', 'MATTEL', 'Disfruta tu paseo por la imponente selva de la isla salvaje, pero cuidado con la serpiente ¡que le gusta la comida sobre ruedas! ¿Podrán evitar convertirse en comida de estas criaturas? Incluye un auto Hot Wheels. Puede conectarse con otros playsets y pistas.', NULL, 1, 'JUG0652', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni12', 2, NULL, NULL),
(7570, 9, 'HW Auto Lavado', 'T3543', 'MATTEL', '¡Este set de juego de tres pisos le da a los niños toda la diversión y emoción de un verdadero auto lavado! Los niños podrán lavar, enjuagar y secar sus vehículos Hot Wheels. ¡Inclusive usa jabón de verdad y tiene un funcional elevador para subir al auto al centro de mejoras! Incluye un auto Hot Wheels.', NULL, 1, 'JUG0653', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni13', 2, NULL, NULL),
(7571, 9, 'Hot Wheels Surtido de Pistas', 'X2604', 'MATTEL', '¡Estas pistas son la fórmula adrenalizante para la diversión! Los autos avanzan a toda velocidad listos para derribar los obstáculos, ¿pero podrán? Este nuevo surtido incluye las pistas de Gravedad y las pistas básicas para revivir diferentes experiencias a toda velocidad. Incluye un auto Hot Wheels. Puede conectarse con otros playsets y pistas.', '', 1, 'JUG0654', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-12-07', 1, 0, 11, 1, 'ni14', 2, 13, '2015-12-07 08:38:33'),
(7572, 9, 'HW Gravity Trackset Asst.', 'R6507', 'MATTEL', '¡Estas pistas convierten a la gravedad en emocionantes carreras! Es surtido, incluye un estacionamiento y un mega salto.', NULL, 1, 'JUG0655', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni15', 2, NULL, NULL),
(7573, 9, 'Hot Wheels  Autos Basicos', 'C4982', 'MATTEL', '¡Nuestra colección de autos básicos Hot Wheels, a escala 1:64, ofrece una gran variedad de los más atractivos vehículos! ¡Este 2015 la colección de Hot Wheels tiene cuatro increíbles segmentos que en total son 400 diferentes autos!\r\nValido por una unidad.', '', 1, 'JUG0656', 0, 0, 0, 0, 1, 16, '2015-11-25', '2016-01-18', 1, 0, 11, 1, 'ni16', 2, 13, '2016-01-18 09:23:40'),
(7574, 11, 'F-P Brilliant Basics Andadera Primeros Pasos', 'M9523', 'MATTEL', 'La Andadera Primeros Pasos es ideal para estabilizar los primeros pasos de la bebé. Tiene una base ancha con ruedas y mango fuerte para que le sea más fácil a la bebé empujarlo. La bebé escucha melodías cuando oprime el osito que se menea cerca del manubrio. Al frente de la andadera hay una barra de rodillo, objetos grandes que giran y un librito que aumenta la diversión. ', NULL, 1, 'NIN0186', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni17', 2, NULL, NULL),
(7575, 11, 'F-P Andadera León Musical', 'Y9854', 'MATTEL', 'Es un tierno león que cuenta con dos modalidades de juego: Siéntate y Juega; Párate y Camina. El primer modo le ofrece al bebé una nariz que se ilumina cuando el bebé la presiona, un piano con alegres sonidos y música, un espejo con una página abatible, dos orejitas juguetonas que giran cuando el bebé las golpea, un colorido disco giratorio, tres sonajas y una mariposa que se desliza por la melena del león. ¡En la modalidad de Párate y Camina, el bebé se estimulará caminando con melodías y tonadas que lo recompensan mientras da sus primeros pasos!', NULL, 1, 'NIN0187', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni18', 2, NULL, NULL),
(7576, 11, 'F-P Brilliant Basics Andadera Actividades Musicales', 'V3254', 'MATTEL', '¡Aumenta la emoción de aprender a caminar con un divertido acompañamiento musical en un resistente carrito para empujar! El bebé se puede sentar y jugar también: tocando, presionando, girando y volteando. Hay páginas para cambiar, actividades entretenidas, y divertidas melodías.', NULL, 1, 'NIN0188', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni19', 2, NULL, NULL),
(7577, 11, 'F-P Ríe y Aprende Escúter Aprende Conmigo', 'CGT13', 'MATTEL', 'El increíble escúter de Aprendizaje Continuo, esta diseñado e inspirado en los escúters europeos además incluyen cuatro botones y llaves. Frases y canciones. Tablero de moto con luces. ', NULL, 1, 'NIN0189', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni20', 2, NULL, NULL),
(7578, 9, 'Bm Figura de 12” + Vehículo', 'DGF13', 'MATTEL', 'Prepárate para intensas emociones y velocidad en este increíble Batijet con una figura articulada de 12 pulgadas. Este vehículo tiene un increíble diseño, llantas que giran e icónicos detalles que le darán a Batman el poder que necesita para salvar Ciudad Gótica. Las armas de las alas son removibles para un combate mano a mano. ¡Abróchate el cinturón y prepárate para la aventura!', NULL, 1, 'JUG0657', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni21', 2, NULL, NULL),
(7579, 9, 'Dc Comics Figuras Articuladas', 'CDM61', 'MATTEL', 'Colecciona a tus Super héroes favoritos de DC Comics para estar listo en la batalla! Con esta figura de 12 pulgadas puedes jugar con los héroes y villanos (Cada uno se vende por separado) ¡Para una increíble diversión contra el crimen! ', NULL, 1, 'JUG0658', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni22', 2, NULL, NULL),
(7580, 9, 'Max Steel Max Hidro Calor', 'CDX39', 'MATTEL', '¡Lleva la aventura al siguiente nivel con Max, combinando el poder del fuego y el agua! Max aparece por primera vez en modo Calor, después, con solo presionar un botón, su casco y armadura de pecho se transforman en modo acuático. ¡Max tiene doble armamento! Carga y dispara su cañón, puede disparar agua a una gran distancia. ¡O lanza su proyectil de fuego para freír a su enemigo! Los niños podrán recrear épicos combates o explorar nuevas aventuras.', NULL, 1, 'JUG0659', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni23', 2, NULL, NULL),
(7581, 9, 'Max Steel Surtido Figura Básica + DVD', 'BHF37', 'MATTEL', '¡Lleva tus heróicas aventuras al siguiente nivel con estas figuras de Max Steel y DVDs! en la serie animada, Max tiene la habilidad de generar Turbo Energía. Afortunadamente conoce a Steel, un alienígena biomecánico que lo ayuda a controlar su poder. ¡Juntos se convierten en los más grandes súper héroes! Estas increíbles figuras de 12 pulgadas vienen con Max en diferentes modos de ataque, con armas o proyectiles desprendibles, y dos de sus más monstruosos enemigos Dread Látigo de Espinas y Extroyer Escorpión, con su propia transformación o ataque característico. El DVD contiene dos explosivos episodios, material extra y un vistazo a la nueva película de Max Steel.', NULL, 1, 'JUG0660', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni24', 2, NULL, NULL),
(7582, 9, 'Toy Story Surtido Figuras de Lujo', 'Y4569', 'MATTEL', 'Estas figuras de seis pulgadas resaltan la personalidad de los personajes más populares de Toy Story ¡con habilidades de movimiento geniales! Presiona el botón en el pecho de Buzz para extender sus alas. Aprieta las piernas de Woody para verlo sacudir su látigo. Jala el cordón en la espalda de Jessie para verla cambiar a la posición de danza. O tira de la cola de Tiro al Blanco para verlo en acción. Los niños amarán recrear las escenas de acción vistas en las películas. Empaque con opción de “Pruébame”. Se venden por separado.', NULL, 1, 'JUG0661', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni25', 2, NULL, NULL),
(7583, 9, 'Barbie Casa Glam con Muñeca', 'CFB65', 'MATTEL', '¡Esta casa es ideal para que Barbie® se refresque y descanse! Además viene con un asa, por lo que es completamente portátil. Abre el playset para revelar una hermosa cocina, una increíble habitación y un baño. Barbie puede preparar la comida en la estufa y comer en la barra. ¡Hay espacio para otra amiga! La cama con su cobija suave, se ve completamente acogedora, mientras que el candelabro rosa, añade un toque de glamour. en el baño encontrarás todos los accesorios para vestirse a la última moda. Barbie® viene con un vestido listo para el verano, con increíbles rayas y accesorios rosas. Muñeca incluida.', NULL, 1, 'JUG0662', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni26', 2, NULL, NULL),
(7584, 9, 'Barbie Peinados y Colores ', 'CFN47', 'MATTEL', '¡Barbie adora pintar su cabello y ahora ella puede hacerlo con tan sólo agregar agua! Simplemente sumerge el cepillo en el agua y deslízalo en el hermoso cabello de Barbie®, ¡su cabello cambia de color! Incluye dos pasadores en forma de flor, dos pasadores en forma de moño y un peine rosa. ¡Barbie está lista para causar sensación en cualquier evento!', NULL, 1, 'JUG0663', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni27', 2, NULL, NULL),
(7585, 9, 'BoomCo Railstringer', 'CJF19', 'MATTEL', '¡El lanzador Railstringer™ cuenta con esta increíble tecnología llamada Smart Stick™ que te permite ver en donde pegó tu disparo!¡Duplica la acción con Railstinger, con dos increíbles formas de jugar: 1 disparos únicos de gran precisión y dos como un accesorio junto a otro lanzador de BoomCo para un disparo doble! ¡El Railstinger dispara hasta increíbles 15 metros de distancia! Dobla la manija, para unirlo a otro blaster BoomCo para incrementar la acción. El Railstinger viene con tres dardos y un objetivo Smart Stick.', NULL, 1, 'JUG0664', 0, 0, 0, 0, 2, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni28', 2, 4, '2016-03-03 08:04:58'),
(7586, 9, 'Hot Wheels Paquete de 3', 'K5904', 'MATTEL', 'Los paquetes de tres coches Hot Wheels contienen los más increíbles vehículos de metal, a escala 1:64, con temas relacionados. ¡Cada paquete es una colección instantánea!', '', 1, 'JUG0665', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-12-01', 1, 0, 11, 1, 'ni29', 2, 13, '2015-12-01 08:52:57'),
(7587, 9, 'Hot Wheels Paquete 5 ', '1806', 'MATTEL', 'Los paquetes de cinco coches Hot Wheels contienen los más increíbles vehículos, a escala 1:64, con temas relacionados. ¡Cada paquete es una colección instantánea!', '', 1, 'JUG0666', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-12-01', 1, 0, 11, 1, 'ni30', 2, 13, '2015-12-01 08:50:41'),
(7588, 9, 'Matchbox Surtido Sky Busters O Hot Wells Autos Básicos x2 unidades surtidas', '68982 - C4982', 'MATTEL', 'El surtido tiene una amplia variedad de aviones y helicópteros de Sky Busters valido una unidad para vivir la aventura con Matchbox. \r\nNuestra colección de autos básicos Hot Wheels, a escala 1:64 valido dos unidades, ofrece una gran variedad de los más atractivos vehículos\r\nsolo aplica para una marca o referencias', '', 1, 'JUG0667', 0, 0, 0, 0, 1, 16, '2015-11-25', '2016-03-08', 1, 0, 11, 1, 'ni31', 2, 12, '2016-03-08 16:41:34'),
(7589, 9, 'Little Mommy Aprendiendo a Ir al Baño', 'X1520', 'MATTEL', '¡Es tiempo de celebrar el gran logro que es aprender a ir al baño! Sienta a la muñeca en su bañito y escucha los divertidos sonidos y animadas frases al “ir” al baño; después ¡mira dentro del bañito para encontrar lo que ha hecho tu pequeña! No olvides “jalarle” para escuchar sonidos reales y más frases divertidas. ¡Toda la diversión de la hora del baño sin ensuciar! Incluye un vasito para beber con brillos, así como accesorios para limpiar las manos para ampliar y completar el juego. Empaque con función “Pruébame”. ', NULL, 1, 'JUG0668', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni32', 2, NULL, NULL),
(7590, 9, 'Little Mommy Bebita Interactiva Hora de Ir Al Baño', 'X4125', 'MATTEL', 'Esta muñequita incluye su propio set de baño, en donde las niñas pueden ayudar a su muñeca a hacer pipí y popó, lavar sus manos y cepillar sus dientes. Incluye un bañito, lavabo, toalla y todo lo necesario para su aseo personal. ¡El bañito no necesita agua por lo que no hay tiradero, sólo diversión! ', NULL, 1, 'JUG0669', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni33', 2, NULL, NULL),
(7591, 9, 'F-P Imaginext Mega T-Rex', 'W1594', 'MATTEL', 'Llevando a los clásicos dinosaurios al siguiente nivel, el Mega T-Rex tiene acción motorizada, efectos de sonido y armadura removible. Cuando presionas el botón de su espalda empezará a mover el cuello, abrir y cerrar su mandíbula al mismo tiempo que emite emocionantes sonidos. Viene con un casco, dos lanzadores de proyectiles y un personaje de Imaginext.', NULL, 1, 'JUG0670', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni34', 2, NULL, NULL),
(7592, 9, 'Barbie Básica Surtido', 'T7439', 'MATTEL', 'Surtido de increíbles muñecas súper a la moda al estilo único de Barbie®.', NULL, 1, 'JUG0671', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni35', 2, NULL, NULL),
(7593, 9, 'Ever After High Primer Capítulo', 'CFB14', 'MATTEL', 'Abre un nuevo capítulo en Ever After High™, donde las hijas y los hijos adolescentes de los personajes famosos de cuentos clásicos deberán decidir entre seguir o no, los pasos de sus padres. Este surtido tiene cuatro de los más espectaculares personajes de cuentos clásicos en Ever After High. Raven Queen™, hija de la Reina Malvada y Madeline Hatter™, hija del Sombrerero Loco, son Rebels soñadoras, que buscaran reescribir su destino. Apple White™, hija de Blancanieves y Briar Beauty™, hija de la Bella Durmiente son Royals. Cada muñeca viene con un soporte y cepillo.', NULL, 1, 'JUG0672', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni36', 2, NULL, NULL),
(7594, 11, 'F-P Bloques Estímulos y Juego', 'H9810', 'MATTEL', 'Bloques es un  juego  adecuado para los recién nacidos, los bebés mayores, e incluso niños pequeños.', NULL, 1, 'NIN0190', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni37', 2, NULL, NULL),
(7595, 9, 'DM Surtido Temático de Minions', 'CNC79', 'MATTEL', 'Ayuda a los Minions a combatir el fuego en el set de juego de bomberos, o acompáñalos a surfear en la fiesta de playa. Prepara a los Minions para la acción cambiando los ojos, el pelo, la ropa, incluso los brazos y los pies.', NULL, 1, 'JUG0673', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni38', 2, NULL, NULL),
(7596, 9, 'Disney Princess Sofía Surtido 9”', 'CMT54', 'MATTEL', '¡Las fanáticas de la Princesa Sofía adorarán esta muñeca de 9 pulgadas! El surtido incluye a Sofia en su vestido característico y as su hermana Amber. Están articuladas para recrear las escenas favoritas de las niñas.', NULL, 1, 'JUG0674', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni40', 2, NULL, NULL),
(7597, 11, 'F-P Shakira Kira', 'DKG67', 'MATTEL', 'Desarrolla habilidades sensoriales. Motricidad fina. Conceptos básicos y aprendizaje bilingüe. Más de 30 canciones, melodias y frases ', NULL, 1, 'NIN0191', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni41', 2, NULL, NULL),
(7598, 11, 'F-P Shakira Balón de Fútbol Musical', 'CMC18', 'MATTEL', 'Ahora con este balón de futbol pondrás en movimiento a tu bebé fue diseñado en colaboración con Shakira para estimular el desarrollo del bebé.', NULL, 1, 'NIN0192', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni42', 2, NULL, NULL),
(7599, 9, 'Matchbox Autos Básicos', '30782', 'MATTEL', 'Autos a escala 1:64 con un nuevo surtido en el que podrás elegir entre autos reales, o de aventura. Son los ideales para poder vivir las mejores aventuras.\r\nValido por una unidad.', '', 1, 'JUG0675', 0, 0, 0, 0, 1, 16, '2015-11-25', '2016-01-18', 1, 0, 11, 1, 'ni43', 2, 13, '2016-01-18 09:07:58'),
(7600, 9, 'Monster High Dl/Pc Ast', 'CBX71', 'MATTEL', 'Este surtido de muñecas incluye a  Skelita, con su traje favorito que incluye accesorios  como gafas de sol azules y una diadema adornada con flores.  Operetta se roba el show con acentos musicales, incluye una bolsa blanca con notas musicales y un bolso en forma de teclado de color purpura. ', NULL, 1, 'JUG0676', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni44', 2, NULL, NULL),
(7601, 9, 'HW SW Surtido de Pistas Batallas Estelares', 'CHB13', 'MATTEL', '¡Dos de las marcas favoritas de los niños (Hot Wheels® y Star Wars™) han unido fuerzas! Los niños adorarán jugar icónicas batallas entre las fuerzas, con emocionantes pistas que pondrán a prueba sus habilidades y precisión. Cada una tiene emoción de velocidad e incluye un auto.', NULL, 1, 'JUG0677', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni45', 2, NULL, NULL),
(7602, 9, 'Barbie y sus Hermanas en una Aventura de Perritos Cámper de Lujo', 'CJT42', 'MATTEL', '¡Cuando Barbie va por el camino en su camper, todo es posible! Este glamoroso vehículo viene con dos asientos al frente. Cuando levantas la manija este vehículo se transforma en un camper de tres pisos. Convierte la cabina frontal en un baño, retira las sillas para revelar un escusado, gira el volante y se convertirá en un lavabo. Abre las puertas trasera y encontrarás una increíble cocina, con refrigerador, lavabo, horno y estufa, gira la llanta de refacción y se convertirá en una fogata. La habitación central viene con una cama doble y una hamaca colgando del techo. Desliza la piscina desde el fondo del camper y conéctalo al tobogán que sale del segundo piso. Barbie (se vende por separado) se puede deslizar desde el segundo piso, que viene con un sofá, televisión y un increíble candelabro. en el tercer piso las niñas en encontraran una mesa y sillas para una comida bajo el sol.', NULL, 1, 'JUG0678', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni46', 2, NULL, NULL),
(7603, 9, 'Barbie Auto de Playa', 'CJD12', 'MATTEL', 'Con su diseño de toldo abierto este increíble Auto de Playa es perfecto para que Barbie y Ken paseen y se diviertan bajo el sol. Incluye a Barbie y a Ken.', NULL, 1, 'JUG0679', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni47', 2, NULL, NULL),
(7604, 9, 'Barbie y Sus Hermanas en Una Aventura de Perritos Bicicleta con Perritos', 'CLD94', 'MATTEL', ' Con 2 perritos incluidos, Barbie está en una gran aventura. Mientras las niñas empujan la bicicleta, los pedales se mueven y los perritos se mueven con ella en sus patines.  Para empezar la acción, coloca a Barbie, coloca sus manos en el manubrio y los pies en los pedales, coloca a la perrita mamá en la patineta grande y al cachorro en la pequeña.', NULL, 1, 'JUG0680', 0, 0, 0, 0, 1, 16, '2015-11-25', '2015-11-25', 1, 0, 11, 1, 'ni48', 2, NULL, NULL),
(7605, 9, 'Barbie Sirena Burbujas Mágicas', 'CFF49', 'MATTEL', '¡Esta magnífica sirena hace burbujas y más burbujas! ¡Por primera vez, las niñas pueden crear su propio mundo de fantasía con esta fantástica característica! Jala la cuerda en su espalda para que su cola de sirena gire y cree un mar de burbujas! Cualquier solución para hacer burbujas funcionará. Incluye un cepillo, una tiara y un kit para hacer burbujas.', '', 1, 'JUG0681', 0, 0, 0, 0, 1, 16, '2015-11-25', '2016-01-08', 1, 12000, 11, 1, 'ni49', 2, 13, '2016-01-08 16:57:59'),
